('1hzG2Lq6vHa', '2024s102', 'Evaluasi Penyelenggaraan Statistik Sektoral (EPSS)', '2024', '2024s109', '<p><strong>Ketua Tim</strong>: Wahyu Agung Sutikno<br><strong>PJK</strong>: Darwis Abubakar</p>\r\n<p>Tim Pelaksana/TPB: Yan Yan Gustiana, M. Alimuddin, Fikri, Azwar, Darwis Abubakar, Nur Hasanah, Dewi Putri Rahayu</p>', '<p>Rincian progres EPSS dapat dilihat pada gsheet di tautan: <a href=\"http://s.bps.go.id/11_monitoring_epss2024\">http://s.bps.go.id/11_monitoring_epss2024</a></p>\r\n<p>Progres penilaian Kamis, 16 Mei 2024 pukul 14:00 sebagai berikut:<br>1 pemda (Aceh Jaya) status *Pending Dokumen*, artinya telah melakukan *SUBMIT* penilaian mandiri dan menunggu tahap penilaian dokumen;<br>0 pemda status *Pending Supervisor*, artinya sudah selesai oleh operator dan dalam pemeriksaan supervisor TPI;<br>21 pemda (selain Aceh Jaya dan Kota Lhokseumawe) status *Pending Operator* atau masih dalam proses penilaian mandiri;<br>1 pemko Lhokseumawe berstatus *Belum Isi*.<br><br></p>', '<p>&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 20%; height: 116.953px;\" border=\"1\"><colgroup><col style=\"width: 59.0988%;\"><col style=\"width: 40.9012%;\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>Persiapan pelaksanaan penilaian</td>\r\n<td>: Januari s.d Maret 2024</td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"height: 22.3906px;\">Penilaian mandiri di Instansi Pemda</td>\r\n<td style=\"height: 22.3906px;\">: April s.d Mei 2024</td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"height: 22.3906px;\">Penilaian</td>\r\n<td style=\"height: 22.3906px;\">: Juni s.d Agustus 2024</td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"height: 22.3906px;\">Harmonisasi</td>\r\n<td style=\"height: 22.3906px;\">: Agustus 2024</td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"height: 22.3906px;\">Hasil</td>\r\n<td style=\"height: 22.3906px;\">: September 2024</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><img