('AH7zu0iHbD4', '2024s101', 'Pengelolaan Peningkatan Kompetensi Pegawai', '2024', '2024s108', '<p>Ketua:&nbsp;<strong>Yan Yan Gustiana</strong></p>\r\n<p>Anggota:&nbsp;</p>\r\n<p>Maulizasari</p>\r\n<p>Reza Rezki Pulungan</p>\r\n<p>Wahdini</p>\r\n<p>Edo Mara Nasution</p>', '<ol>\r\n<li>Pengisian CKP dilakukan rutin setiap bulan pada KiPApp&nbsp;<em><a href=\"https://webapps.bps.go.id/kipapp\">website kipapp </a></em></li>\r\n</ol>', '<p>KiPApp rutin setiap bulan dengan deadline pengisian di awal bulan</p>', '2024-03-25 02:22:58', '199509142019032002', 0, NULL, NULL),
('aKSOJV6uBF1', '2024s106', 'Indepth Study SEEA', '2024', '2024s106', '<div class=\"card-body\">\r\n<p><strong>Ketua Tim:</strong>&nbsp;Meita Jumiartanti</p>\r\n<ul>\r\n<li><strong>PIC SINASI:</strong>&nbsp;Fitri Mulyani</li>\r\n<li><strong>Anggota:</strong> Ridha Mutia, Azwar</li>\r\n</ul>\r\n</div>', '<p style=\"text-align: justify;\"><strong>Tujuan Kegiatan</strong><br><em>In-depth Study SEEA tahun 2023 bermaksud untuk memperoleh data/informasi mengenai keanekaragaman hayati dan perubahan iklim di Indonesia, khususnya yang berkaitan dengan dimensi ekonomi dan lingkungan. Oleh karena itu, pada tahun ini BPS menyelenggarakan in-depth study yang memiliki tujuan-tujuan sebagai berikut:&nbsp;</em></p>\r\n<ul>\r\n<li><em>Mengetahui jumlah flora dan fauna serta perubahannya menurut jenis spesies </em></li>\r\n<li><em>Mengetahui pemanfaatan keanekaragaman hayati dalam ekonomi </em></li>\r\n<li><em>Mengetahui penyediaan produk-produk energi </em></li>\r\n<li><em>Mengetahui penggunaan bahan bakar dan produk energi yang dapat menghasilkan emisi gas rumah kaca&nbsp;</em></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Dokumentasi Kegiatan</strong></p>\r\n<p><em><a href=\"s.bps.go.id/Administrasi-SEEA2024\">s.bps.go.id/Administrasi-SEEA2024</a></em></p>', '<p><strong>Pelatihan Petugas &gt;&gt;</strong> 24-28 Juni 2024</p>\r\n<p><strong>Pendataan Lapangan &gt;&gt;</strong> Mei-September 2024</p>', '2024-02-20 05:44:15', '199503172018022001', 1, NULL, '2024-06-30 06:40:14'),
