('nV6yPgVi009', '2024s104', 'Survei Perusahaan Perkebunan', '2024', '2024s104', '<p>Hendra Gunawan</p>\r\n<p>Raiski Ramadhoni</p>', '<ul>\r\n<li>Survei Perusahaan Perkebunan merupakan kegiatan pengumpulan data perkebunan yang dilakukan pada seluruh perusahaan perkebunan yaitu data&nbsp;Perusahaan Perkebunan Negara dan data Perusahaan Perkebunan Swasta di&nbsp;wilayah Republik Indonesia.</li>\r\n<li>Pengumpulan data perusahaan perkebunan&nbsp;dilakukan secara online yang disebut dengan Sedia Data Perusahaan Perkebunan&nbsp;melalui aplikasi SKB Online (SEDAPP Online).</li>\r\n<li>Pengumpulan data Survei Perusahaan Perkebunan dilakukan dengan periode bulanan&nbsp;(Sedapp Online) dan tahunan (SKB Tahunan) dengan Output Luas Tanaman dan Produksi Komoditas.</li>\r\n<li>Jadwal dan direktori Sedapp Online untuk target pencacahan 2024 dapat dilihat pada tautan <a href=\"https://s.bps.go.id/direktori_sedap2024\">https://s.bps.go.id/direktori_sedapp2024</a></li>\r\n<li>Jadwal dan direktori SKB Tahunan untuk target pencacahan 2024 dapat dilihat pada tautan <a href=\"https://s.bps.go.id/direktori_sedap2024\">https://s.bps.go.id/direktori_skb2023</a></li>\r\n<li>Input Data Sedapp Online bulanan dilakukan pada alamat: <a href=\"https://skb.bps.go.id/pb\">https://skb.bps.go.id/pb</a></li>\r\n<li>Input data SKB Tahunan dilakukan pada alamat: <a href=\"https://pengolahan.bps.go.id/produksi/perkebunan/SKB_tahunan\">https://pengolahan.bps.go.id/produksi/perkebunan/SKB_tahunan</a></li>\r\n</ul>', '<ul>\r\n<li>Pengumpulan, Pemeriksaan, dan Pengolahan Data : Setiap Bulan</li>\r\n<li>Tabulasi Data: Angka Tetap 2023 (Mei 2024) dan Angka Sementara 2024 ( September 2024)</li>\r\n</ul>\r\n<p>&nbsp;</p>', '2024-03-25 04:52:23', '198306042006021003', 1, NULL, NULL),
