('o1FfHVaJLkQ', '2024s107', 'Monitoring Bulanan Pelaporan SPI Kabupaten/Kota ', '2024', '2024s101', '<p>Ketua : Edo Mara Nasution</p>\r\n<p>Anggota :</p>\r\n<p>M. Reza</p>\r\n<p>Bahzur Andria</p>\r\n<p>Andi Arif Ginting</p>\r\n<p>Teti Safrida Purba</p>\r\n<p>Dewi Putri Rahayu</p>\r\n<p>Cut Sandra Novalia</p>', '<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-add-space: auto; text-align: justify; text-indent: 18.0pt; line-height: 115%; margin: 0cm 0cm .0001pt 18.0pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Pasal 33 Peraturan Pemerintah Nomor 8 Tahun 2006 tentang Pelaporan Keuangan dan Kinerja Instansi Pemerintah menyatakan bahwa untuk mendukung keandalan laporan keuangan pemerintah maka perlu diselenggarakan sistem pengendalian intern yang di dalamnya mencakup proses rekonsiliasi antara transaksi keuangan yang diakuntansikan oleh Pengguna Anggaran/Kuasa Pengguna Anggaran (PA/KPA) dengan data transaksi keuangan yang diakuntansikan oleh Bendahara Umum Negara. Monitoring ini dilaksanakan secara rutin setiap bulannya dalam rangka pengawalan terkait kelengkapan administrasi keuangan di seluruh satker kabupaten/kota di lingkup wilayah Provinsi Aceh</span></p>', '<p>Setiap Bulannya pada tahun anggaran 2024</p>', '2024-02-21 01:10:24', '198306172005021001', 0, NULL, NULL),
