('QZCL27h5NdX', '2024s104', 'Survei Perusahaan Non Migas', '2024', '2024s104', '<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 1.5;\"><strong><span style=\"font-size: 10.0pt; line-height: 107%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-ID;\">Cut Malahayati (PJK)</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 1.5;\"><span style=\"font-size: 10.0pt; line-height: 107%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-ID;\">Fikri</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 1.5;\"><span style=\"font-size: 10.0pt; line-height: 107%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-ID;\">Nova Misrina</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 1.5;\"><span style=\"font-size: 10.0pt; line-height: 107%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-ID;\">Ridha Mutia</span></p>', '<p>Periode Survei Perusahaan Non Migas adalah <strong>Tahunan</strong> dengan<strong><em> Output</em>&nbsp;</strong>Data Produksi, Nilai, Jlh Tenaga Kerja, Balas Jasa.</p>', '<p><em>on progress</em></p>', '2024-02-21 02:12:07', '198607292009022005', 0, NULL, NULL),
('r45WyEDsj1x', '2024s105', 'Survei Kesejahteraan Petani (SKP)', '2024', '2024s103', '<p>PJK&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: Mursalina</p>\r\n<p>Anggota&nbsp; &nbsp; : Dwi Susanti</p>', '<p>Link:</p>', '<table style=\"width: 473.984px;\" border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td>Pelatihan&nbsp;</td>\r\n<td>&nbsp;Mei 2024</td>\r\n</tr>\r\n<tr>\r\n<td>Pencacahan</td>\r\n<td>&nbsp;Juni 2024</td>\r\n</tr>\r\n</tbody>\r\n</table>', '2024-02-05 04:22:18', '198411122006042002', 0, NULL, NULL),
('RgcRLwR8Dqh', '2024s106', 'Survei Khusus Triwulan Neraca Produksi (SKTNP)', '2024', '2024s106', '<p><strong>Ketua Tim:</strong> Meita Jumiartanti</p>\r\n<ul>\r\n<li><strong>PIC SKTNP:</strong> Fitri Mulyani</li>\r\n<li><strong>Anggota:</strong> Ridha Mutia, Azwar&nbsp;</li>\r\n</ul>', '<p><strong>Tujuan Survei</strong></p>\r\n<p style=\"text-align: justify;\"><em>Survei ini bertujuan untuk memperoleh informasi terkini dan tercepat mengenai perkembangan indikator produksi, tenaga kerja, indikator harga dan pendapatan/output yang akan digunakan dalam&nbsp;penyusunan PDB/PDRB triwulanan lapangan usaha barang dan jasa. Kegiatan usaha yang menjadi fokus SKTNP 2024 adalah kegiatan usaha yang belum memiliki indikator produksi yang rutin dalam penyusunan PDB/PDRB triwulanan. Indikator produksi tersebut akan diperoleh dengan cara melihat perkembangan perusahaan/usaha. Perusahaan/usaha yang terpilih menjadi sampel akan disurvei selama <strong>empat kali </strong>periode pencacahan dalam satu tahun kegiatan.</em></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Dokumentasi Kegiatan</strong></p>\r\n<p><a href=\"s.bps.go.id/KAK-SKDNP\">s.bps.go.id/KAK-SKDNP</a></p>\r\n<p style=\"line-height: 1;\"><strong>Link Bahan Ajar</strong></p>\r\n<p><a href=\"s.bps.go.id/BahanPelatihanSKDNP24\">s.bps.go.id/BahanPelatihanSKDNP24</a></p>\r\n<p><strong>QnA Pelatihan Inda</strong></p>\r\n<p><a href=\"http://s.bps.go.id/QnA-Pelatihan-Inda\" target=\"_blank\" rel=\"noopener\">s.bps.go.id/QnA-Pelatihan-Inda</a> &nbsp;</p>', '<p><span style=\"font-size: 12pt;\"><strong>Pelaksanaan Lapangan (Pengumpulan &amp; Pengawasan)&nbsp;</strong></span></p>\r\n<ul>\r\n<li style=\"font-style: italic;\"><em><strong>Data Triwulan IV 2023 &gt;&gt; </strong>Januari 2024</em></li>\r\n<li style=\"font-style: italic;\"><em><strong>Data Triwulan I 2024&nbsp; &nbsp;&gt;&gt; </strong>April 2024</em></li>\r\n<li style=\"font-style: italic;\"><em><strong>Data Triwulan II 2024&nbsp; &gt;&gt; </strong>Juli 2024</em></li>\r\n<li style=\"font-style: italic;\"><em><strong>Data Triwulan III 2024 &gt;&gt; </strong>Oktober 2024</em></li>\r\n</ul>', '2024-02-20 05:42:33', '199503172018022001', 1, NULL, '2024-05-28 09:51:25'),
('rIYNWnH6SXI', '2024s106', 'Survei Neraca Terintegrasi (SINASI)', '2024', '2024s106', '<p><strong>Ketua Tim:</strong>&nbsp;Meita Jumiartanti</p>\r\n<ul>\r\n<li><strong>PIC SINASI:</strong>&nbsp;Fitri Mulyani</li>\r\n<li><strong>Anggota:</strong> Ridha Mutia, Azwar</li>\r\n</ul>', '<p><strong>Tujuan Survei</strong></p>\r\n<p style=\"text-align: justify;\"><em>Survei Neraca Terintegrasi pada tahun 2024 ini bertujuan untuk </em><em>memperoleh informasi terbaru mengenai parameter yang akan digunakan </em><em>dalam penyusunan PDB, SUT, dan Tabel I-O. Tujuan dari survei ini adalah </em><em>memperoleh data dan informasi yang akan digunakan untuk penyusunan </em><em>matriks margin perdagangan dan pengangkutan (Trade and Transport Margin/TTM), struktur pendapatan, serta struktur pengeluaran </em><em>usaha/perusahaan.&nbsp;</em></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p><strong>Dokumentasi Kegiatan</strong></p>\r\n<p><a href=\"s.bps.go.id/KAK-SKDNP\">s.bps.go.id/KAK-SKDNP</a></p>\r\n<p><strong>Link Bahan Ajar</strong></p>\r\n<p><a href=\"s.bps.go.id/BahanPelatihanSKDNP24\">s.bps.go.id/BahanPelatihanSKDNP24</a></p>\r\n<p><strong>QnA Pelatihan Inda</strong></p>\r\n<p><a href=\"http://s.bps.go.id/QnA-Pelatihan-Inda\" target=\"_blank\" rel=\"noopener\">s.bps.go.id/QnA-Pelatihan-Inda</a> &nbsp;</p>', '<p><strong>Pelatihan Petugas &gt;&gt;</strong> 3-7 Maret 2024</p>\r\n<p><strong>Pendataan Lapangan &gt;&gt;</strong> Mei-Oktober 2024</p>', '2024-02-19 02:49:01', '199503172018022001', 1, NULL, '2024-05-28 10:28:52'),
