('sN5CqSZc3u1', '2024s104', 'Survei Statistik Pertanian Hortikultura (SPH)', '2024', '2024s104', '<p>Hendra Gunawan</p>\r\n<p>Nilam Humaira</p>', '<ul>\r\n<li>Pengumpulan data Komoditas Hortikultura Sayuran, Buah-Buahan, Tanaman Biofarmaka, dan Tanaman Hias.</li>\r\n<li>Untuk mendapatkan data luas/jumlah tanaman, produksi dan rata-rata harga di petani pada tingkat kecamatan.</li>\r\n<li>Pengolahan dan Monitoring dapat diakses pada alamat: <a href=\"https://pengolahan.bps.go.id/produksi/hortikultura/sph2021\">https://pengolahan.bps.go.id/produksi/hortikultura/sph2021</a>&nbsp;</li>\r\n</ul>', '<ul>\r\n<li>Pengolahan dokumen SPH paling lambat tanggal 20 setelah periode laporan&nbsp;berakhir setiap bulannya.</li>\r\n</ul>', '2024-03-13 03:24:09', '198306042006021003', 1, NULL, NULL),
