('U0nrPAayOEg', '2024s105', 'Survei Harga Konsumen (SHK)', '2024', '2024s103', '<p>Ketua Tim : Titiek Zurryati</p>\r\n<p>PJK : Mursalina</p>\r\n<p>Anggota: Dwi Susanti</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Andariati Afrida</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Nyimas Eka</p>', '<p>Link Dashboard: <a title=\"shk.bps.go.id\" href=\"shk.bps.go.id\" target=\"_blank\" rel=\"noopener\">shk.bps.go.id</a></p>', '<table style=\"width: 500px;\" border=\"1\" cellspacing=\"1\" cellpadding=\"1\">\r\n<tbody>\r\n<tr>\r\n<td>Pencacahan SHK</td>\r\n<td>Januari - Desember 2024</td>\r\n</tr>\r\n<tr>\r\n<td>Pengolahan SHK</td>\r\n<td>Januari - Desember 2024</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>', '2024-02-05 03:45:36', '198411122006042002', 0, NULL, NULL),
('Ugrr3pc2ZzU', '2024s101', 'Penyusunan Laporan Keuangan TA2023', '2024', '2024s101', '<p>Tasdik Ilhamudin</p>\r\n<p>Edo Mara Nasution</p>\r\n<p>Teti Safrida Purba</p>\r\n<p>Bahzur Andria</p>', '<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-add-space: auto; text-align: justify; text-indent: 18.0pt; line-height: 115%; margin: 0cm 0cm .0001pt 18.0pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Pasal 33 Peraturan Pemerintah Nomor 8 Tahun 2006 tentang Pelaporan Keuangan dan Kinerja Instansi Pemerintah menyatakan bahwa untuk mendukung keandalan laporan keuangan pemerintah maka perlu diselenggarakan sistem pengendalian intern yang di dalamnya mencakup proses rekonsiliasi antara transaksi keuangan yang diakuntansikan oleh Pengguna Anggaran/Kuasa Pengguna Anggaran (PA/KPA) dengan data transaksi keuangan yang diakuntansikan oleh Bendahara Umum Negara. </span><span style=\"font-family: \'Calibri Light\', sans-serif; font-size: 12pt; text-indent: 18pt;\">Salah satu karakteristik yang merupakan prasyarat normatif yang diperlukan agar laporan keuangan pemerintah dapat memenuhi kualitas yang dikehendaki menurut Kerangka Konseptual Standar Akuntansi Pemerintahan adalah keandalan (reliability).</span><span style=\"mso-spacerun: yes;\">&nbsp; </span><span style=\"font-family: \'Calibri Light\', sans-serif; font-size: 12pt; text-indent: 18pt;\">Pasal 46 ayat (1) Peraturan Menteri Keuangan Nomor 213/PMK.05/2013 tentang Sistem Akuntansi dan Pelaporan Keuangan Pemerintah Pusat sebagaimana telah diubah dengan Peraturan Menteri Keuangan Nomor 215/PMK.05/2016 menyatakan bahwa dalam rangka meyakinkan keandalan dalam penyusunan laporan keuangan dilakukan rekonsiliasi. Pasal 46B ayat (10) Peraturan Menteri Keuangan Nomor 213/PMK.05/2013 tentang Sistem Akuntansi dan Pelaporan Keuangan Pemerintah Pusat sebagaimana telah diubah dengan Peraturan Menteri Keuangan Nomor 215/PMK.05/2016 menyatakan bahwa ketentuan lebih lanjut mengenai tata cara pelaksanaan rekonsiliasi diatur dengan Peraturan Menteri Keuangan.</span></p>', '<p>Januari - Februari 2024</p>', '2024-02-21 01:03:44', '198306172005021001', 0, NULL, NULL),
