('WD7TLRc7UKe', '2024s101', 'Pengelolaan Implementasi Rencana Aksi Manajemen Perubahan Tahun 2024', '2024', '2024s108', '<p>Ketua : <strong>Yan Yan Gustiana</strong></p>\r\n<p>CC : <strong>Hendra Gunawan</strong></p>\r\n<p>CA :</p>\r\n<p>Wira Junardi</p>\r\n<p>Fikri</p>\r\n<p>Muhammad Hafidz Al Ahmad Bit</p>\r\n<p>Maulizasari</p>\r\n<p>Mazaya Alifah Syadzwina</p>\r\n<p>Anandika Dian Pramesti</p>\r\n<p>&nbsp;</p>', '<ol>\r\n<li>Kegiatan Berapi (Briefing Rabu Pagi) dilakukan setiap hari rabu pagi bersama pimpinan dan seluruh pegawai BPS Provinsi Aceh maupun kabupaten/kota <em><a href=\"https://drive.bps.go.id/s/iqNYorG3PF56jcL?path=%2FBERAPI\">BERAPI</a></em></li>\r\n<li><em>SK dan Surat Tugas CAN periode 2024 BPS Aceh <a href=\"https://drive.bps.go.id/apps/files/?dir=/%5B02.%20Share%20-%20BPS%20Provinsi%20Aceh%5D/08%20Tim%20Tranformasi%20dan%20Budaya%20Organisasi/Change%27s%20Team/Change%20Agents&amp;fileid=28845742\">SK dan Surat Tugas</a></em></li>\r\n<li>Briefing Rabu Pagi (Berapi) merupakan media diskusi atara pimpinan dan pegawai serta media&nbsp;<em>sharing knowledge</em>&nbsp;di lingkungan BPS Provinsi Aceh.</li>\r\n<li>Diselenggarakan setiap hari rabu secara&nbsp;<em>Offline&nbsp;</em>maupun&nbsp;<em>Online&nbsp;</em>dengan peserta yakni pegawai di BPS Provinsi Aceh dan BPS Kabupaten/Kota se Provinsi Aceh.</li>\r\n<li>Dokumentasi dan Notulensi Berapi Tahun 2024 dapat diakses pada alamat:&nbsp;<a href=\"https://drive.bps.go.id/s/iqNYorG3PF56jcL?path=%2FBERAPI\">Kegiatan Berapi</a></li>\r\n</ol>', '<ol>\r\n<li>Kegiatan Berapi dilakukan setiap hari Rabu&nbsp; <em><a href=\"https://drive.bps.go.id/apps/onlyoffice/s/iqNYorG3PF56jcL?fileId=27849405\">Jadwal BERAPI 2024</a></em></li>\r\n<li>Berapi dilakukan dengan tema yang berbeda setiap minggunya dengan jadwal sebagai berikut:</li>\r\n<li>Minggu 1 : Sharing knowledge bersama kabupaten/kota&nbsp;</li>\r\n<li>Minggu 2 : Internalisasi BerAKHLAK</li>\r\n<li>Minggu 3 : Rabu Aspirasi</li>\r\n<li>Minggu 4 : Internalisasi Indikator Statistik</li>\r\n</ol>', '2024-03-26 02:20:35', '199509142019032002', 0, NULL, NULL),
