('0zNdmuID3zz', 'or7gJNJZZV2', '2024-07-03', 'NGOBRAS-Rapat Evaluasi Kemiskinan Kabupaten/Kota 2024', 'upload_file/image_timeline/WtXn8bxajHL5LZFyFKOC9g7GCnDzfCwGIepgk8ck.jpg', '<p>Kegiatan ini dihadiri oleh Kepala BPS Aceh, Kepala BPS Kako dan Seluruh Penanggung Jawab Statistik Sosial, kegiatan ini bertujuan untuk mengevaluasi kembali angka kemiskinan sementara kabupaten/kota, beberapa point yang disampaikan BPS kabupaten/kota pada pertemuan ini adalah :</p>\r\n<p>Melakukan evaluasi kembali terkait perubahan P0<br>Melakukan evaluasi kembali Garis Kemiskinan</p>\r\n<p>Tindak lanjut dari kegiatan ini adalah, Tim Kemiskinan BPS Aceh akan mengkaji kembali angka kemiskinan sementara dan berkoordinasi dengan Tim Kemiskinan BPS Pusat sebelum angka difinalkan.</p>', '2024-07-17 09:30:50', '198109132006021001', 1, '2024-07-17 09:30:50', '2024-07-17 09:30:50'),
