('4w2hSs116Qj', 'SSzViDQnobN', '2024-02-19', 'ESENSIAL: Edukasi Seputar Pembinaan Statistik Sektoral', 'upload_file/image_timeline/esen_page-0001.jpg', '<p>Dalam rangka penguatan SDM Pembinaan Statistik Sektoral (PSS), Sekretariat PSS BPS menyelenggarakan internalisasi bertajuk ESENSIAL: Edukasi Seputar Pembinaan Statistik Sektoral.<br>Esensial edisi perdana ini akan membahas 3 agenda sekaligus, yaitu Standar Data Statistik, Metadata Statistik, dan Rekomendasi Kegiatan Statistik, bersama para fasilitator yang ahli di bidangnya.</p>\r\n<p>ESENSIAL: Edukasi Seputar Pembinaan Statistik Sektoral:&nbsp;<a href=\"https://s.id/pss-esensial\">https://s.id/pss-esensial</a></p>', '2024-02-21 12:30:11', '198804162008011001', 0, NULL, NULL),
