('N5pucLfXoqv', 'roWEJTMB2mG', '2023-12-08', 'Pelatihan Petugas SNLIK 2024 di Hotel Grand Permata Hati Banda Aceh', 'upload_file/image_timeline/image_2024-02-16_092249807.png', '<p>Dokumentasi dapat diakses melalui : <a href=\"https://drive.google.com/drive/u/6/folders/1-FiO6AlHy_ONDslwUKWMv4p9TcwQDnck\">https://drive.google.com/drive/u/6/folders/1-FiO6AlHy_ONDslwUKWMv4p9TcwQDnck</a>&nbsp;</p>', '2024-02-16 09:23:58', '198109132006021001', 0, NULL, NULL),
('na5i3OIRGUq', 'qYYmHQtzpbw', '2024-07-10', 'NGOBRAS-Evaluasi Kualitas Data Seruti Triwulan II', 'upload_file/image_timeline/do12ornstAU1JJXoms7O9PLDERwItYQInRM2zL5J.jpg', '<p><span style=\"font-size: 12pt; font-family: \'andale mono\', monospace;\">Kegiatan ini dilaksanakan dalam rangka mengevaluasi anomali hasil pendataan lapangan &nbsp;Seruti Triwulan II di seluruh Kabupaten/Kota, beberapa point yang dibahas adalah terjadinya penurunan pada beberapa rincian diantaranya <span style=\"line-height: 107%;\">Makanan dan Minuman tidak beralkohol, Minuman beralkohol dan tembakau, Furnitur, Rekresi Keperluan Pesta dan Upacara atau kenduri, dan lain lain.</span></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: \'andale mono\', monospace;\"><span style=\"line-height: 107%;\">Tindak lanjut dari kegiatan ini adalah, BPS Kako melalukan evaluasi kembali terhadap seluruh isian hasil pendataan lapangan.</span></span></p>', '2024-07-16 15:52:01', '198109132006021001', 1, '2024-07-16 15:52:01', '2024-07-16 15:52:01'),
