('nFa6L9OcK61', 'or7gJNJZZV2', '2024-06-27', 'Rapat Pembahasan Angka Kemiskinan Kako Sementara 2024 di BPS Provinsi', 'upload_file/image_timeline/QrobPN1VCrqro5EeAYFO91IqcR5t0h38TK7m57Ko.jpg', '<p>Rapat ini dihadiri oleh Kepala BPS Aceh dan Tim Kemiskinan BPS Aceh, kegiatan ini bertujuan untuk membahas dan mengevaluasi Angka Kemiskinan Kako Sementara 2024.</p>', '2024-07-17 09:19:37', '198109132006021001', 1, '2024-07-17 09:19:37', '2024-07-17 09:19:37'),
