INSERT INTO `timeline` (`kode_timeline`, `kode_kegiatan`, `tanggal_timeline`, `judul_timeline`, `image_timeline`, `detail_timeline`, `timestamp`, `nip_pegawai`, `flag_kabkot`, `created_at`, `updated_at`) VALUES
('qiOuDqRKMvn', 'SSzViDQnobN', '2024-01-29', 'Kick Off Pembinaan Statistik Sektoral Kementerian/Lembaga', 'upload_file/image_timeline/Kick_page-0001-min.jpg', '<p>&ldquo;Setiap kita menghasilkan data statistik, kita pasti menginginkan data yang berkualitas. Maka dalam proses pembinaan statistik ini kita berupaya mendorong kementerian/lembaga (K/L) menghasilkan data yang berkualitas. Untuk menghasilkan data prioritas yang berkualitas, BPS melakukan pembinaan, yaitu pembinaan dari sisi proses, kualitas data, kelembagaan dan SDM, serta sistem statistik nasional,&rdquo; ujar Deputi Bidang Metodologi dan Informasi Statistik BPS, Imam Machdi saat membuka kegiatan \"Kick Off Pembinaan Statistik Sektoral Kementerian/Lembaga&rdquo; di Jakarta (29/1). Pembinaan Statistik Sektoral yang dilakukan BPS sebagai pembina data statistik sesuai amanat Perpres No. 39 Tahun 2019 tentang Satu Data Indonesia.</p>\r\n<p><span style=\"font-size: 10pt; color: rgb(52, 73, 94);\"><a style=\"color: rgb(52, 73, 94);\" href=\"https://www.instagram.com/p/C2tPoHJyQzT/?igsh=MTZubDlyMzRtMXoydA==\">https://www.instagram.com/p/C2tPoHJyQzT/?igsh=MTZubDlyMzRtMXoydA==</a></span></p>', '2024-02-21 12:31:49', '198804162008011001', 0, NULL, NULL),
