('SKZN2UTqjVK', '1hzG2Lq6vHa', '2024-01-01', 'Penyiapan Instrumen Pelaksanaan Penilaian', 'upload_file/image_timeline/NULL', '<p>Penyiapan Instrumen dilaksanakan sejak <strong>minggu pertama s.d. minggu ketiga Januari </strong>(2 Januari s.d. 16 Februari) meliputi:</p>\r\n<ol>\r\n<li>Perbaikan bahan ajar;</li>\r\n<li>Pemetaan contoh bukti dukung;</li>\r\n<li>Penjelasan bobot indikator;</li>\r\n<li>Penyusunan petunjuk teknis;</li>\r\n<li>Perbaikan Simbatik</li>\r\n</ol>', '2024-02-27 11:54:18', '199707072019011003', 0, NULL, NULL),
