('t6DveSEZ5Gt', 'wBMvH50bTcd', '2024-02-01', 'Pembuatan Microsite email blast', 'upload_file/image_timeline/NULL', '<p>Email database pengguna layanan PST digunakan untuk menjadi email tujuan pengiriman email blast setiap BPS Provinsi Aceh melakukan Rilis Berita Resmi Statistik (BRS). link yang digunakan adalah <a href=\"http://s.bps.go.id/BRS1100\">http://s.bps.go.id/BRS1100</a></p>', '2024-02-23 09:20:11', '199607132019012002', 0, NULL, NULL),
('U2fhxcCESPO', 'h8G4j1lh8Or', '2024-03-18', 'SOP Rilis BRS', 'upload_file/image_timeline/NULL', '<p>Membuat draft SOP rilis BRS / lokakarya <a href=\"https://drive.bps.go.id/apps/files/?dir=/%5B02.%20Share%20-%20BPS%20Provinsi%20Aceh%5D/08%20Tim%20Tranformasi%20dan%20Budaya%20Organisasi/2.%20Internalisasi%20Nilai%20%26%20Budaya%20Organisasi/Maret&amp;fileid=26712242\">Draft SOP Rilis BRS/Lokakarya</a></p>', '2024-03-25 09:27:14', '199509142019032002', 1, NULL, NULL),
('u9IX3zMmTv2', 'wBMvH50bTcd', '2024-02-19', 'Pengiriman email blast pertama kali', 'upload_file/image_timeline/email_blast_feb.jpeg', '<p>Untuk bulan februari, email blast yang dikirim sudah sebanyak 3 kali. dengan judul format berbeda sesuai angka yang di rilis oleh BPS Aceh. Sebagai contoh:</p>\r\n<p>Assalammualaikum Wr.Wb.<br>Halo Sobat Data,<br>Terima kasih telah mengakses dan menggunakan data BPS Aceh.<br>Tahukan Anda, Perkembangan Ekspor dan Impor Aceh, Januari 2024?</p>\r\n<p>Silahkan klik link berikut untuk &nbsp;preferensi media yang Anda minati:</p>\r\n<p>http://s.bps.go.id/BRS1100<br>&nbsp;<br>Hormat Kami,<br>Tim Diseminasi BPS Aceh</p>', '2024-02-23 09:22:31', '199607132019012002', 0, NULL, NULL),
('UaOjEDd9UyD', '1hzG2Lq6vHa', '2024-02-19', 'Inhouse Instrumen', 'upload_file/image_timeline/NULL', '<p>merupakan kegiatan yang dilakukan di BPS RI dalam penyempurnaan aplikasi melalui serangkaian uji coba yang diadakan secara internal. Inhouse Instrumen dilaksanakan sejak&nbsp;<strong>minggu keempat Februari s.d. minggu pertama Maret </strong>(19 Februari s.d. 1 Maret 2024)&nbsp;</p>', '2024-02-27 04:09:41', '199707072019011003', 0, NULL, NULL),
('UaTycvfuxtv', 'WD7TLRc7UKe', '2024-01-31', 'Sosialisasi Bupesta', 'upload_file/image_timeline/15-SEPTEMBER-2023.png', '<p>Sosialisasi Bupesta</p>\r\n', '2024-01-31 08:41:54', '199501232018021001', 0, NULL, NULL),
('udksOr82uW7', 'j3F3ljkdj0T', '2024-05-31', 'Pengadaan Tahun 2024', 'upload_file/image_timeline/og3i5lJjyxhb4cgTXnjvPryAUvuMLI661ZowF9dW.jpg', '<p>Kontrak Tahun 2024</p>\r\n<ol>\r\n<li>Pengadaan Tenaga Kerja Outsourching Kantor Meliputi Cleaning Servis, Security Guard dan Supir BPS Provinsi Aceh T.A. 2024</li>\r\n<li>Pengadaan Pakaian Seragam Pegawai BPS Provinsi Aceh</li>\r\n<li>Pengadaan Akomodasi dan Konsumsi Penyelenggaraan Pelatihan Petugas SKDNP 2024</li>\r\n<li>Pengadaan Pemeliharaan Ruang Rilis Gedung Kantor Bertingkat BPS Provinsi Aceh NUP 2</li>\r\n<li>Pemeliharaan ruang pengolahan lantai 1 BPS Provinsi Aceh NUP 2</li>\r\n<li>Pengadaan Karpet Tile</li>\r\n<li>Pengadaan Perlengkapan Pelatihan Petugas Survei Ekonomi Pertanian Tahun 2024</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>Kwitansi Tahun 2024</p>\r\n<ol>\r\n<li>Pengadaan Pemeliharaan Air Conditioner/ AC</li>\r\n<li>Pengadaan Pakaian Seragam Pegawai BPS Provinsi Aceh</li>\r\n<li>Pengadaan Pemeliharaan Halaman Kantor</li>\r\n<li>Pengadaan Pencetakan Dokumen Susenas Maret Tahun 2024</li>\r\n<li>Pengadaan Pencetakan Kuesioner Seruti Triwulan I Tahun 2024</li>\r\n<li>Pencetakan Kuesioner Pelatihan Petugas Sakernas Februari 2024</li>\r\n<li>Pengadaan Barang Persediaan Pemeliharaan Bola Lampu</li>\r\n<li>Pengadaan Pemeliharaan Gedung Kantor Bertingkat Berupa Pekerjaan Bongkar Sekat Ruang Rilis Lantai 1 dan Perbaikan Plafond&nbsp; Ruang Cut Meuitia</li>\r\n<li>Pengadaan Kursi Roda Barang Ekstrakomtable</li>\r\n<li>Pemeliharaan Inventaris Kantor (Bongkar Pasang Lemari besi Role Opeck)</li>\r\n<li>Pengadaan Pencetakan Stiker Signage &amp; Wayfinding</li>\r\n<li>Pengadaan Pencetakan Poster berAkhlak</li>\r\n<li>Pengadaan Pencetakan Baliho</li>\r\n<li>Pengadaan Mic Toa Barang Ekstrakomtable</li>\r\n</ol>\r\n<p>&nbsp;</p>', '2024-05-31 15:47:39', '198902272012122001', 1, '2024-05-31 15:47:39', '2024-06-11 16:04:51'),
