('wAVhycaxQCX', 'DGJgQuNK5hM', '2023-12-15', 'Surat Identifikasi DSBS Sakernas Februari 2024', 'upload_file/image_timeline/Capture4.PNG', '<p>Surat dapat diakses melalui link : <a href=\"https://drive.google.com/drive/u/6/folders/1oXN-isqk6TvDs4JAuRniAqdOarcjkvJY\">https://drive.google.com/drive/u/6/folders/1oXN-isqk6TvDs4JAuRniAqdOarcjkvJY</a>&nbsp;</p>', '2024-02-15 14:06:33', '198109132006021001', 0, NULL, NULL),
('WBTYRDaUzVI', 'YLiRbw4RNpg', '2024-02-13', 'Rekomendasi kegiatan Statistik P2K-APBA Biro Adpem Sekda Aceh dan profil Kependudukan SRKA Aceh', 'upload_file/image_timeline/NULL', '<p>Integrasi kegiatan Rekomendasi dengan Pembinaan Statistik Sektoral</p>\r\n<ul>\r\n<li>Audiensi dengan <a href=\"https://webapps.bps.go.id/rujukan/pembinaan/public/dokumentasi/3387\" target=\"_blank\" rel=\"noopener\">Biro Administrasi Pembangunan Sekretariat Daerah Aceh Tanggal 23 januari 2024</a></li>\r\n<li>Audiensi dengan <a href=\"https://webapps.bps.go.id/rujukan/pembinaan/public/dokumentasi/3389\" target=\"_blank\" rel=\"noopener\">Dinas Registrasi dan Kependudukan Aceh Tanggal 25 januari 2024</a></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Surat Persetujuan permintaan Rekomendasi Kegiatan P2K-APBA Biro Administrasi Pembangunan dapat dilihat&nbsp;<a title=\"surat permintaan rekomendasi kegiatan P2K-APBA Biro Adpem Sekda Aceh\" href=\"https://romantik.web.bps.go.id/rekomendasi-terbit/K-24.1100.001\" target=\"_blank\" rel=\"noopener\">disini</a></p>\r\n<p>Surat Persetujuan permintaan Rekomendasi kegiatan Penyusunan profil Kependudukan Aceh Dinas Registrasi dan Kependudukan Aceh dapat dilihat <a title=\"surat permintaan rekomendasi kegiatan Profil kependudukan Aceh DRKA Aceh\" href=\"https://romantik.web.bps.go.id/rekomendasi-terbit/K-24.1100.002\" target=\"_blank\" rel=\"noopener\">disini</a></p>', '2024-04-02 10:49:10', '198512052008011002', 1, NULL, NULL),
('WDKQqJ2wxFV', 'GwijEQUfrix', '2024-06-19', 'Penyampaian Rencana Tindak Lanjut Pemeriksaan Data Podes 2024', 'upload_file/image_timeline/4j7lBJsHW8Aftw1t7CUcKsI00k6Gbwo5RRHtJNrG.png', '<p>Surat dapat diakses melalui link : <a href=\"https://drive.google.com/drive/u/6/folders/1hiN5fpJ_QU6M8iM3TOcoOMCKjWKw7b5d\">https://drive.google.com/drive/u/6/folders/1hiN5fpJ_QU6M8iM3TOcoOMCKjWKw7b5d</a>&nbsp;</p>', '2024-07-16 15:38:18', '198109132006021001', 0, '2024-07-16 15:38:18', '2024-07-16 15:38:18'),
