('WiAIXfXgx88', 'U0nrPAayOEg', '2024-05-21', 'Capacity Building Surveyor Harga KPw BI Aceh dan BPS  Provinsi Aceh', 'upload_file/image_timeline/KiR2XclRnGwurK1Pd9Dmst89R3ph3jG2lJnHoKMs.jpg', '<p>Kegiatan :&nbsp;</p>\r\n<p>Capacity Building Surveyor Harga KPw BI Aceh dan BPS</p>\r\n<p>Provinsi Aceh</p>\r\n<p>Tempat : Hotel Adimulia, Medan</p>\r\n<p>Peserta : Tim Statistik Harga BPS Prov. Aceh, PJK Statistik Harga BPS Kab/Kota IHK, petugas SHK BPS Kab/Kota IHK, Tim KPw BI Aceh, dan Surveyor Harga KPw BI Aceh</p>', '2024-06-10 14:57:12', '197902252002122004', 1, '2024-06-10 14:57:12', '2024-06-10 14:57:12'),
('wIghl3GW2Dn', '0bMEyb37DsM', '2024-01-08', 'Surat Pemanggilan Peserta Pelatihan Petugas Susenas 2024 2024', 'upload_file/image_timeline/image_2024-02-16_094109271.png', '<p>Surat dapat diakses melalui link : <a href=\"https://drive.google.com/drive/u/6/folders/1P25zBAtRlPB6Rf80eRcynXhePcEEntXB\">https://drive.google.com/drive/u/6/folders/1P25zBAtRlPB6Rf80eRcynXhePcEEntXB</a>&nbsp;</p>', '2024-02-16 09:41:11', '198109132006021001', 0, NULL, NULL),
('WJrlO1kgXPj', 'JRPIk2lXriW', '2024-03-01', 'Undangan Workshop FasiIitator FGD IDI 2023', 'upload_file/image_timeline/image_2024-03-01_160722482.png', '<p>Surat dapat diakses melalui link : <a href=\"https://drive.google.com/drive/u/6/folders/1jm4IW7uJvCuJ_KvevAU-udVOhb-JnUih\">https://drive.google.com/drive/u/6/folders/1jm4IW7uJvCuJ_KvevAU-udVOhb-JnUih</a>&nbsp;</p>', '2024-03-01 16:07:24', '198109132006021001', 0, NULL, NULL),
('wjyz2zdnxLb', 'SSzViDQnobN', '2023-12-11', 'Pelatihan Pembina Statistik Sektoral Tahap 1', 'upload_file/image_timeline/Pembukaan_page-00011.jpg', '<p>Pelatihan Pembina Statistik Sektoral Tahap 1 (Pelatihan PSS Tahap 1) diselenggarakan Pusdiklat BPS berkolaborasi dengan Direktorat&nbsp;Diseminasi Statistik.</p>\r\n<p>Pembukaan Pelatihan Pembinaan Statistik Sektoral Tahap 1 (Tingkat Pusat dan Provinsi) di Pusdiklat Badan Pusat Statistik. <span style=\"color: rgb(35, 111, 161);\"><a style=\"color: rgb(35, 111, 161);\" href=\"https://youtu.be/ustFuX6-GHo\">https://youtu.be/ustFuX6-GHo</a></span></p>\r\n<p>1. Pelatihan telah diikuti 164 peserta yang terdiri dari 104 peserta sebagai Tim Pembina dari BPS Provinsi dan 60 peserta sebagai Tim Pembina dari BPS RI. Peserta terbagi menjadi 4 kelas.&nbsp;<br>2. Peserta telah mengikuti pembelajaran sebanyak 37 Jam Pembelajaran (JP) dengan rincian;&nbsp;<br>a. Overviu secara daring pada tanggal 5 Desember 2023 sebanyak 4 JP, &nbsp;<br>b. Pembelajaran Mandiri (Massive Open Online Course/MOOC) pada tanggal 5 s.d. 8 Desember 2023 sebanyak 6 JP, dan&nbsp;<br>c. Pembelajaran Klasikal di Pusdiklat tanggal 11 s.d. 13 Desember 2023 sebanyak 27 JP.&nbsp;<br>3. Output yang diharapkan melalui pelatihan ini adalah Tim Pembina Statistik Sektoral di BPS RI dan BPS Provinsi memiliki kemampuan dan kompetensi;&nbsp;<br>a. Menjadi pengajar/fasilitator pada Pelatihan Pembina Statistik Sektoral Tahap 2 yang akan diikuti oleh Tim Pembina Statistik Sektoral dari seluruh BPS Kabupaten/Kota.&nbsp;<br>b. Menjalankan tugas sebagai Tim Pembina Statistik Sektoral.&nbsp;<br>c. Khusus untuk Tim Pembina Statistik Sektoral di tingkat BPS Provinsi, peserta diharapkan mampu mengkoordinasikan pembinaan statistik sektoral di kabupaten/kota wilayahnya masing-masing.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>Link Dokumentasi &nbsp;Pelatihan Pembina Statistik Sektoral Tahap 1:</strong><br><a href=\"https://pusdiklatbps.quickconnect.to/d/s/wNzt76oZw1MMhkOpUqeRIfVSLWpWtHN5/lTZSQUt6YFO929LkyGwxKOkFS065iqM6-vrWAh_00-Ao\">https://pusdiklatBPS.quickconnect.to/d/s/wNzt76oZw1MMhkOpUqeRIfVSLWpWtHN5/lTZSQUt6YFO929LkyGwxKOkFS065iqM6-vrWAh_00-Ao</a></p>', '2024-02-21 12:17:50', '198804162008011001', 0, NULL, NULL),
('wJZ5Mu30ZGA', 'WD7TLRc7UKe', '2024-03-06', 'Berapi 8 Maret 2024', 'upload_file/image_timeline/WhatsApp_Image_2024-03-06_at_09_15_26_(2).jpeg', '<p>Sharing Knowledge <em><a href=\"https://drive.bps.go.id/apps/files/?dir=/%5B02.%20Share%20-%20BPS%20Provinsi%20Aceh%5D/08%20Tim%20Tranformasi%20dan%20Budaya%20Organisasi/Change%27s%20Team/BERAPI/6%20Maret%202024&amp;fileid=31192155\">Berapi 6 Maret</a></em></p>', '2024-03-26 09:04:42', '199509142019032002', 0, NULL, NULL),
('wnqr1MybW0K', 'nxiBDAGKG8z', '2024-03-01', 'Berita Resmi Statistik (BRS)', 'upload_file/image_timeline/WhatsApp_Image_2024-03-22_at_15_06_13.jpeg', '<p>Perkembangan IHK Provinsi Aceh Februari 2024</p>\r\n<p>Berita Resmi Statistik (BRS) IHK Provinsi Aceh dapat dilihat melalui tautan :</p>\r\n<p><a href=\"https://aceh.bps.go.id/pressrelease.html\">https://aceh.bps.go.id/pressrelease.html</a></p>', '2024-03-22 15:13:23', '197902252002122004', 1, NULL, NULL),
