('y6DppZRa72N', 'SSzViDQnobN', '2024-01-05', 'Pelatihan Pembina Statistik Sektoral Tahap 2', 'upload_file/image_timeline/212_page-0001.jpg', '<p style=\"line-height: 1.4;\">Menindaklanjuti Surat Deputi Bidang Metodologi dan Informasi Statistik Nomor B-372/03000/PS.100/11/2023 Tanggal 15 November 2023 perihal Permintaan Tim Pembina Statistik Sektoral Tingkat Daerah, disampaikan bahwa pelatihan Pembina Statistik Sektoral Tahap 2 akan dilaksanakan mulai 5 Januari 2024 melalui E-WARKOP Pusdiklat BPS.</p>\r\n<p style=\"line-height: 1.4;\"><strong>Rekaman Zoom Pelatihan PSS - Aceh: &nbsp;</strong><a href=\"https://www.youtube.com/playlist?list=PL96OlKj4P3HLOJhd4G1kEOVHrrZsel6hg\">https://www.youtube.com/playlist?list=PL96OlKj4P3HLOJhd4G1kEOVHrrZsel6hg</a></p>', '2024-02-21 12:32:57', '198804162008011001', 0, NULL, NULL),
('yfQJswYygqJ', 'DRCiGmxGBft', '2024-05-08', 'pelatihan Petugas VREST UMK 2024', 'upload_file/image_timeline/xvFRwdtm5S4mWjDupYJqHdRBhQ8uVaG5NnXnDeif.jpg', '<p>Kegiatan : Pelatihan petugas Survei Penyediaan Makanan Minuman Tahun 2024</p>\r\n<p>Jadwal : Pelatihan dilakukan secara online tanggal 3 Mei dan secara offline tanggal 8 Mei 2024</p>\r\n<p>Tempat : Hotel Oasis, Banda Aceh</p>\r\n<p>Innas : Effendy dan Mursalina</p>\r\n<p>Peserta : PML dan PCL dari Kabupaten/kota sampel</p>', '2024-06-11 08:40:08', '197902252002122004', 1, '2024-06-11 08:40:08', '2024-06-11 08:40:08'),
('yKAv3QtyTGR', 'Z5hOHdYZKqH', '2024-02-19', 'Rapat', 'upload_file/image_timeline/WhatsApp_Image_2024-02-19_at_09_41_19_(1).jpeg', '<p>Rapat Bulanan Februari 2024&nbsp;<a href=\"https://drive.bps.go.id/apps/files/?dir=/%5B02.%20Share%20-%20BPS%20Provinsi%20Aceh%5D/08%20Tim%20Tranformasi%20dan%20Budaya%20Organisasi/Notula%20Rapat%20Trafo&amp;openfile=28838020\">Rapat Bulanan Februari 2024</a></p>', '2024-02-19 11:46:09', '199509142019032002', 0, NULL, NULL),
('YMBERHseR8r', 'U0nrPAayOEg', '2024-06-06', 'Rapat Penyusunan Model kebijakan Inflasi di Aceh', 'upload_file/image_timeline/SDDjJkeJPJigVVoOtya338Ymi7S6uohMSMOtz7Jm.jpg', '<p>Kegiatan : Kunjungan tim Badan Riset dan Inovasi Nasional ke Aceh terkait Penyusunan Model kebijakan Inflasi di Aceh</p>\r\n<p>Tempat : Ruang Rapat II.B Lantai II Bappeda Aceh</p>\r\n<p>Daftar Undangan : Tim TPID Provinsi Aceh</p>\r\n<p>Uraian kegiatan :&nbsp;</p>\r\n<p>Tim Badan Riset dan Inovasi Nasional menyampaikan paparan, selanjutnya Biro perekonomian Setda Aceh menyampaikan Laporan Pengendalian Inflasi di Aceh selama tahun 2023 dan 2024.</p>\r\n<p>BPS Provinsi Aceh menyampaikan data perkembangan inflasi Aceh Januari - Mei 2024, serta komoditas pemberi andil inflasi terbesar. Selanjutnya juga memberikan informasi terkait komoditas pemberi andil inflasi/deflasi pada tahun 2023</p>\r\n<p>BI menyampaikan peranannya dalam pengendalian inflasi Aceh dengan menginformasikan program - program yang sudah dilaksanakan.</p>\r\n<p>Dinas terkait menyampaikan program yang sudah dilaksanakan dalam upaya pengendalian inflasi Aceh, seperti operasi pasar, pasar murah, pasar tani, subsidi ongkos angkut dan lain-lain</p>', '2024-06-10 14:51:20', '197902252002122004', 1, '2024-06-10 14:51:20', '2024-06-10 14:51:20'),
('YmwxuRxyS1p', 'GwijEQUfrix', '2024-06-03', 'Ngobrol Santai Kegiatan Statistik Sosial', 'upload_file/image_timeline/HzLNpqTQM4njdFAlF0oUM4O85BbAr33v2XM9B8I4.png', '<p>Surat dapat diakses melalui link : <a href=\"https://drive.google.com/file/d/1M5mj-UAtLhpb1fa2CB_h6z-spidJgK_i/view\">https://drive.google.com/file/d/1M5mj-UAtLhpb1fa2CB_h6z-spidJgK_i/view</a>&nbsp;</p>', '2024-06-03 15:56:33', '198109132006021001', 1, '2024-06-03 15:56:33', '2024-06-03 15:56:33'),
('YPJR40BwpFx', 'DGJgQuNK5hM', '2023-12-19', 'Surat Persiapan Pelatihan Sakernas Februari 2024 (Aceh)', 'upload_file/image_timeline/Capture33.PNG', '<p>Surat dapat diakses melalui link : &nbsp;<a href=\"https://drive.google.com/drive/u/6/folders/1oXN-isqk6TvDs4JAuRniAqdOarcjkvJY\">https://drive.google.com/drive/u/6/folders/1oXN-isqk6TvDs4JAuRniAqdOarcjkvJY</a>&nbsp;</p>', '2024-02-15 12:15:39', '198109132006021001', 0, NULL, NULL),
