INSERT INTO `zlog_kegiatan` (`id`, `kode_kegiatan`, `kode_eselon`, `nama_kegiatan`, `tahun_kegiatan`, `kode_tim_kerja`, `detail_anggota_tim`, `detail_informasi_penting`, `detail_jadwal`, `timestamp`, `nip_pegawai`, `ket`, `flag_kabkot`, `created_at`, `updated_at`) VALUES
(1, 'MvJsTOOUaic', '2024s103', 'susenas 2024', '2024', '2024s102', '<p>Ketua : Hakim</p>\r\n\r\n<p>Anggota :&nbsp;</p>\r\n\r\n<ul>\r\n	<li>ridho</li>\r\n	<li>gito</li>\r\n	<li>evi</li>\r\n	<li>uli</li>\r\n</ul>\r\n', '<p>Survei Sosial Ekonomi Nasional (Susenas) merupakan salah satu sumber data sosial ekonomi dimana data SUSENAS digunakan sebagai perencanaan dan evaluasi program pembangunan nasional, Perencanaan dan Evaluasi Program Pembangunan Sektoral (Kementerian/Lembaga) dan Penyediaan Indikator SDG&rsquo;s, RPJMN dan Nawacita. Sedangkan indikator yang dihasilkan dari data SUSENAS antara lain Indikator Sasaran Makro Pembangunan, Indikator RPJMN dan Indikator SDG&rsquo;s. Adapun 3 dari 11 sasaran makro pembangunan tahun 2020-2024 dihitung menggunakan data SUSENAS.</p>\r\n\r\n', '<p>Tujuan Penyelenggaraan Pelatihan&nbsp;Petugas Susenas Maret 2022&nbsp;&nbsp;adalah sebagai berikut&nbsp;:</p>\r\n\r\n<ol>\r\n	<li>Menghasilkan petugas yang mempunyai memahami konsep dan definisi Susenas Maret 2022;</li>\r\n	<li>Menghasilkan petugas yang&nbsp;memahami dokumen-dokumen yang digunakan dalam pendataan Susenas Maret 2022;</li>\r\n	<li>Menghasilkan petugas yang&nbsp;memahami SOP pada pelaksanaan Susenas Maret 2022;</li>\r\n	<li>Menghasilkan petugas yang&nbsp;mampu mendata Susenas Maret 2022 dengan baik.</li>\r\n</ol>\r\n', '2024-01-17 06:31:48', '198407082008011003', 'baru', 0, NULL, NULL),
(2, 'MvJsTOOUaic', '2024s103', 'susenas 2024', '2024', '2024s102', '<p>Ketua : Hakim</p>\r\n\r\n<p>Anggota :&nbsp;</p>\r\n\r\n<ul>\r\n	<li>ridho</li>\r\n	<li>gito</li>\r\n	<li>evi</li>\r\n	<li>uli</li>\r\n	<li>saya</li>\r\n</ul>\r\n', '<p>Survei Sosial Ekonomi Nasional (Susenas) merupakan salah satu sumber data sosial ekonomi dimana data SUSENAS digunakan sebagai perencanaan dan evaluasi program pembangunan nasional, Perencanaan dan Evaluasi Program Pembangunan Sektoral (Kementerian/Lembaga) dan Penyediaan Indikator SDG&rsquo;s, RPJMN dan Nawacita. Sedangkan indikator yang dihasilkan dari data SUSENAS antara lain Indikator Sasaran Makro Pembangunan, Indikator RPJMN dan Indikator SDG&rsquo;s. Adapun 3 dari 11 sasaran makro pembangunan tahun 2020-2024 dihitung menggunakan data SUSENAS.</p>\r\n', '<p>Tujuan Penyelenggaraan Pelatihan&nbsp;Petugas Susenas Maret 2022&nbsp;&nbsp;adalah sebagai berikut&nbsp;:</p>\r\n\r\n<ol>\r\n	<li>Menghasilkan petugas yang mempunyai memahami konsep dan definisi Susenas Maret 2022;</li>\r\n	<li>Menghasilkan petugas yang&nbsp;memahami dokumen-dokumen yang digunakan dalam pendataan Susenas Maret 2022;</li>\r\n	<li>Menghasilkan petugas yang&nbsp;memahami SOP pada pelaksanaan Susenas Maret 2022;</li>\r\n	<li>Menghasilkan petugas yang&nbsp;mampu mendata Susenas Maret 2022 dengan baik.</li>\r\n</ol>\r\n', '2024-01-18 09:02:00', '199501232018021001', 'edit', 0, NULL, NULL),
