(412, 'sZrNXkRVcyq', '2024s101', 'Rapat kunjungan kerja kanwil DJPB Aceh di BPS Provinsi Aceh', '2024', '2024s101', '<p>Ketua : Tasdik Ilhamudin</p>\r\n<p>Anggota :&nbsp;</p>\r\n<p>Edo Mara Nasution</p>\r\n<p>Reza Rezki Pulungan</p>\r\n<p>Kanasha Humaira</p>\r\n<p>Meita Jumiartanti</p>\r\n<p>Rediansyah Arief</p>\r\n<p>Andi Arif Ginting</p>\r\n<p>Teti Safrida Purba</p>\r\n<p>Zukhra</p>\r\n<p>Bahzur Andria</p>\r\n<p>Nova Misrina</p>\r\n<p>Ferfi Hamdina</p>', '<p>Dalam rangka meningkatkan kualitas laporan keuangan dan pendampingan kepada UAPPA-W lingkup kanwil DJPb Provinsi Aceh, maka dilaksanakanlah FGD bersama pengelola keuangan BPS Provinsi Aceh terkait evaluasi perencanaan, pelaksanaan dan pelaporan keuangan tahun 2023 pada satker BPS Provinsi Aceh.</p>', '<p>20 Februari 2024</p>', '2024-02-21 01:00:15', '198306172005021001', 'baru', 0, NULL, NULL),
(413, 'Ugrr3pc2ZzU', '2024s101', 'Penyusunan Laporan Keuangan TA2023', '2024', '2024s101', '<p>Tasdik Ilhamudin</p>\r\n<p>Edo Mara Nasution</p>\r\n<p>Teti Safrida Purba</p>\r\n<p>Bahzur Andria</p>', '<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-add-space: auto; text-align: justify; text-indent: 18.0pt; line-height: 115%; margin: 0cm 0cm .0001pt 18.0pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Pasal 33 Peraturan Pemerintah Nomor 8 Tahun 2006 tentang Pelaporan Keuangan dan Kinerja Instansi Pemerintah menyatakan bahwa untuk mendukung keandalan laporan keuangan pemerintah maka perlu diselenggarakan sistem pengendalian intern yang di dalamnya mencakup proses rekonsiliasi antara transaksi keuangan yang diakuntansikan oleh Pengguna Anggaran/Kuasa Pengguna Anggaran (PA/KPA) dengan data transaksi keuangan yang diakuntansikan oleh Bendahara Umum Negara. </span><span style=\"font-family: \'Calibri Light\', sans-serif; font-size: 12pt; text-indent: 18pt;\">Salah satu karakteristik yang merupakan prasyarat normatif yang diperlukan agar laporan keuangan pemerintah dapat memenuhi kualitas yang dikehendaki menurut Kerangka Konseptual Standar Akuntansi Pemerintahan adalah keandalan (reliability).</span><span style=\"mso-spacerun: yes;\">&nbsp; </span><span style=\"font-family: \'Calibri Light\', sans-serif; font-size: 12pt; text-indent: 18pt;\">Pasal 46 ayat (1) Peraturan Menteri Keuangan Nomor 213/PMK.05/2013 tentang Sistem Akuntansi dan Pelaporan Keuangan Pemerintah Pusat sebagaimana telah diubah dengan Peraturan Menteri Keuangan Nomor 215/PMK.05/2016 menyatakan bahwa dalam rangka meyakinkan keandalan dalam penyusunan laporan keuangan dilakukan rekonsiliasi. Pasal 46B ayat (10) Peraturan Menteri Keuangan Nomor 213/PMK.05/2013 tentang Sistem Akuntansi dan Pelaporan Keuangan Pemerintah Pusat sebagaimana telah diubah dengan Peraturan Menteri Keuangan Nomor 215/PMK.05/2016 menyatakan bahwa ketentuan lebih lanjut mengenai tata cara pelaksanaan rekonsiliasi diatur dengan Peraturan Menteri Keuangan.</span></p>', '<p>Januari - Februari 2024</p>', '2024-02-21 01:03:44', '198306172005021001', 'baru', 0, NULL, NULL),
(414, 'o1FfHVaJLkQ', '2024s107', 'Monitoring Bulanan Pelaporan SPI Kabupaten/Kota ', '2024', '2024s101', '<p>Ketua : Edo Mara Nasution</p>\r\n<p>Anggota :</p>\r\n<p>M. Reza</p>\r\n<p>Bahzur Andria</p>\r\n<p>Andi Arif Ginting</p>\r\n<p>Teti Safrida Purba</p>\r\n<p>Dewi Putri Rahayu</p>\r\n<p>Cut Sandra Novalia</p>', '<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-add-space: auto; text-align: justify; text-indent: 18.0pt; line-height: 115%; margin: 0cm 0cm .0001pt 18.0pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Pasal 33 Peraturan Pemerintah Nomor 8 Tahun 2006 tentang Pelaporan Keuangan dan Kinerja Instansi Pemerintah menyatakan bahwa untuk mendukung keandalan laporan keuangan pemerintah maka perlu diselenggarakan sistem pengendalian intern yang di dalamnya mencakup proses rekonsiliasi antara transaksi keuangan yang diakuntansikan oleh Pengguna Anggaran/Kuasa Pengguna Anggaran (PA/KPA) dengan data transaksi keuangan yang diakuntansikan oleh Bendahara Umum Negara. Monitoring ini dilaksanakan secara rutin setiap bulannya dalam rangka pengawalan terkait kelengkapan administrasi keuangan di seluruh satker kabupaten/kota di lingkup wilayah Provinsi Aceh</span></p>', '<p>Setiap Bulannya pada tahun anggaran 2024</p>', '2024-02-21 01:10:24', '198306172005021001', 'baru', 0, NULL, NULL),
