(429, 'hW9N0QIaKqD', '2024s102', 'Pemutakhiran MFD', '2024', '2024s105', '<ol>\r\n<li>\r\n<p><strong>Ketua Tim</strong>: Fitral Pratomo</p>\r\n<p><strong>Pjk</strong>: Wira Junardi</p>\r\n<p><strong>Anggota</strong>:&nbsp;</p>\r\n<ul>\r\n<li>Ichsan Hasanudin</li>\r\n<li>Anandika Dian Pramesti</li>\r\n</ul>\r\n</li>\r\n</ol>', '<p>1. Pemutakhiran MFDOnline melalui&nbsp;<a href=\"http://frs.bps.go.id/area\" target=\"_blank\" rel=\"noopener\"><strong><em>frs.bps.go.id/area</em></strong></a>&nbsp;terdiri dari:</p>\r\n<ul>\r\n<li>PWA, perubahan wilayah administrasi level provinsi,&nbsp;kecamatan, dan desa</li>\r\n<li>MB, perubahan Blok Sensus (BS)</li>\r\n<li>MS, Perubahan Satuan Lingkungan Setempat (SLS)</li>\r\n</ul>\r\n<p>2. Rilis Master wilkerstat, <strong><em><a href=\"https://s.bps.go.id/MFD_Rilis_Daerah\" target=\"_blank\" rel=\"noopener\">folder MFD</a></em></strong></p>\r\n<p>2. Publikasi Master File Wilayah (MFW) tahun 2023, <strong><em><a title=\"publikasi MFW 2023\" href=\"https://aceh.bps.go.id/publication/2023/10/31/a270f9a67778b1a118623743/master-file-wilayah-provinsi-aceh-2023.html\" target=\"_blank\" rel=\"noopener\">publikasi MFW 2023</a></em></strong></p>\r\n<p>&nbsp;</p>', '<ul>\r\n<li>Pemutakhiran MFD 2024 Semester I : 1 Februari - 30 Juni 2024</li>\r\n<li>Rilis Master&nbsp;MFD 2024 Semester I : Oktober 2024</li>\r\n<li>Publikasi Master File Wilayah Tahun 2024 : Oktober 2024</li>\r\n<li>Pemutakhiran MFD 2024 Semester II : Juli - Desember 2024</li>\r\n<li>Rilis Master&nbsp;MFD 2024 Semester II : Januari&nbsp;2025</li>\r\n</ul>\r\n<p>&nbsp;</p>', '2024-02-21 03:39:44', '198906132012111001', 'edit', 0, NULL, NULL),
