(509, '5SgApxrhKIf', '2024s102', 'Laci BPS Aceh', '2024', '2024s105', '<p>Developer:</p>\r\n<ul>\r\n<li>Ichsan Hasanudin</li>\r\n<li>Munandar</li>\r\n</ul>', '<p>Aplikasi ini mirip dengan drive.bps.go.id hanya saja lokasi penyimpanan berada di local BPS Aceh. Meskipun penyimpanan berada di local BPS Aceh, tetap bisa diakses secara publik.&nbsp;</p>\r\n<p>link:&nbsp;<a href=\"https://laci.bpsaceh.cloud/\" target=\"_blank\" rel=\"noopener\">laci.bpsaceh.cloud</a></p>', '<p>Sepanjang tahun</p>', '2024-02-27 04:34:24', '199501232018021001', 'edit', 0, NULL, NULL),
