(518, 'SSzViDQnobN', '2024s102', 'Pembinaan Statistik Sektoral (PSS)', '2024', '2024s109', '<p style=\"line-height: 1.5;\"><strong>Ketua Tim</strong>: Wahyu Agung Sutikno<br><strong>Koordinator</strong>: M. Alimuddin<br><strong>Anggota</strong>: Nur Hasanah, Fikri</p>', '<ul>\r\n<li style=\"line-height: 1.5;\"><strong>Materi Final Pelatihan Pembinaan Statistik Sektoral Tahap 1:&nbsp;</strong><a href=\"https://s.bps.go.id/pss1_mat\">https://s.bps.go.id/pss1_mat</a></li>\r\n<li style=\"line-height: 1.5;\"><strong>Pelatihan Pembinaan Statistik Sektoral Tahap 2:&nbsp;</strong><a href=\"http://s.bps.go.id/pss2\">http://s.bps.go.id/pss2</a></li>\r\n<li style=\"line-height: 1.5;\"><strong>Materi Terkait PSS dan Forum SDI: </strong><a href=\"https://s.bps.go.id/forumsdi\">https://s.bps.go.id/forumsdi</a></li>\r\n<li style=\"line-height: 1.5;\"><strong>Daftar Indikatif Data Prioritas 2024 seluruh K/L:</strong> <a href=\"https://link.bappenas.go.id/DP24\">https://link.bappenas.go.id/DP24</a></li>\r\n<li style=\"line-height: 1.5;\"><strong>Dokumentasi Pembinaan Statistik Sektoral:</strong> <a href=\"https://s.bps.go.id/dok_pembinaan\">https://s.bps.go.id/dok_pembinaan</a></li>\r\n<li style=\"line-height: 1.5;\"><strong>Monitoring Pembinaan dan EPSS:</strong> <a href=\"http://s.bps.go.id/monitoring_EPSS24\">http://s.bps.go.id/monitoring_EPSS24</a></li>\r\n<li style=\"line-height: 1.5;\"><strong>Link JDIH BAPPENAS: </strong><a href=\"https://jdih.bappenas.go.id/home/viewhasilpencarian/10\">https://jdih.bappenas.go.id/home/viewhasilpencarian/10</a></li>\r\n</ul>\r\n<p>&nbsp;</p>', '<p>&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 100%; border-width: 1px; border-style: solid; height: 111.953px;\" border=\"1\"><colgroup><col style=\"width: 2.51004%;\"><col style=\"width: 65.0602%;\"><col style=\"width: 32.4297%;\"></colgroup>\r\n<tbody>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"height: 22.3906px;\">\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n</td>\r\n<td styl