(520, 'nV6yPgVi009', '2024s104', 'Survei Perusahaan Perkebunan', '2024', '2024s104', '<p>Hendra Gunawan</p>\r\n<p>Raiski Ramadhoni</p>', '<ul>\r\n<li>Survei Perusahaan Perkebunan merupakan kegiatan pengumpulan data perkebunan yang dilakukan pada seluruh perusahaan perkebunan yaitu data&nbsp;Perusahaan Perkebunan Negara dan data Perusahaan Perkebunan Swasta di&nbsp;wilayah Republik Indonesia.</li>\r\n<li>Pengumpulan data perusahaan perkebunan&nbsp;dilakukan secara online yang disebut dengan Sedia Data Perusahaan Perkebunan&nbsp;melalui aplikasi SKB Online (SEDAPP Online).</li>\r\n<li>Pengumpulan data Survei Perusahaan Perkebunan dilakukan dengan periode bulanan&nbsp;(Sedapp Online) dan tahunan (SKB Tahunan) dengan Output Luas Tanaman dan Produksi Komoditas.</li>\r\n<li>Jadwal dan direktori Sedapp Online untuk target pencacahan 2024 dapat dilihat pada tautan <a href=\"https://s.bps.go.id/direktori_sedap2024\">https://s.bps.go.id/direktori_sedap2024</a></li>\r\n<li>Jadwal dan direktori SKB Tahunan untuk target pencacahan 2024 dapat dilihat pada tautan <a href=\"https://s.bps.go.id/direktori_sedap2024\">https://s.bps.go.id/direktori_skb2023</a></li>\r\n<li>Input Data Sedapp Online bulanan dilakukan pada alamat: <a href=\"https://skb.bps.go.id/pb\">https://skb.bps.go.id/pb</a></li>\r\n<li>Input data SKB Tahunan dilakukan pada alamat: <a href=\"https://pengolahan.bps.go.id/produksi/perkebunan/SKB_tahunan\">https://pengolahan.bps.go.id/produksi/perkebunan/SKB_tahunan</a></li>\r\n</ul>', '<ul>\r\n<li>Pengumpulan, Pemeriksaan, dan Pengolahan Data : Setiap Bulan</li>\r\n<li>Tabulasi Data: Angka Tetap 2023 (Mei 2024) dan Angka Sementara 2024 ( September 2024)</li>\r\n</ul>\r\n<p>&nbsp;</p>', '2024-03-13 03:10:07', '198306042006021003', 'edit', 1, NULL, NULL),
(521, 'sN5CqSZc3u1', '2024s104', 'Survei Statistik Pertanian Hortikultura (SPH)', '2024', '2024s104', '<p>Hendra Gunawan</p>\r\n<p>Nilam Humaira</p>', '<ul>\r\n<li>Pengumpulan data Komoditas Hortikultura Sayuran, Buah-Buahan, Tanaman Biofarmaka, dan Tanaman Hias.</li>\r\n<li>Untuk mendapatkan data luas/jumlah tanaman, produksi dan rata-rata harga di petani pada tingkat kecamatan.</li>\r\n<li>Pengolahan dan Monitoring dapat diakses pada alamat: <a href=\"https://pengolahan.bps.go.id/produksi/hortikultura/sph2021\">https://pengolahan.bps.go.id/produksi/hortikultura/sph2021</a>&nbsp;</li>\r\n</ul>', '<ul>\r\n<li>Pengolahan dokumen SPH paling lambat tanggal 20 setelah periode laporan&nbsp;berakhir setiap bulannya.</li>\r\n</ul>', '2024-03-13 03:24:09', '198306042006021003', 'baru', 1, NULL, NULL),
(522, '9qWMU7cT4Eo', '2024s101', 'Briefing Rabu Pagi', '2024', '2024s108', '<p>Hendra Gunawan</p>\r\n<p>Wira Junardi</p>\r\n<p>Fikri</p>\r\n<p>Muhammad Hafidz Al Ahmad&nbsp;Bit</p>\r\n<p>Maulizasari</p>\r\n<p>Mazaya Alifah Syadzwina</p>\r\n<p>Anandika Dian Pramesti</p>', '<ul>\r\n<li>Briefing Rabu Pagi (Berapi) merupakan media diskusi atara pimpinan dan pegawai serta media <em>sharing knowledge</em> di lingkungan BPS Provinsi Aceh.</li>\r\n<li>Diselenggarakan setiap hari rabu secara <em>Offline </em>maupun <em>Online </em>dengan peserta yakni pegawai di BPS Provinsi Aceh dan BPS Kabupaten/Kota se Provinsi Aceh.</li>\r\n<li>Dokumentasi dan Notulensi Berapi Tahun 2024 dapat diakses pada alamat: https://drive.bps.go.id/s/iqNYorG3PF56jcL</li>\r\n</ul>', '<ul>\r\n<li>Setiap Hari Rabu</li>\r\n</ul>', '2024-03-13 03:35:28', '198306042006021003', 'baru', 1, NULL, NULL),
