(560, '9qWMU7cT4Eo', '2024s101', 'Briefing Rabu Pagi', '2024', '2024s108', '<p>Hendra Gunawan</p>\r\n<p>Wira Junardi</p>\r\n<p>Fikri</p>\r\n<p>Muhammad Hafidz Al Ahmad&nbsp;Bit</p>\r\n<p>Maulizasari</p>\r\n<p>Mazaya Alifah Syadzwina</p>\r\n<p>Anandika Dian Pramesti</p>', '<ul>\r\n<li>Briefing Rabu Pagi (Berapi) merupakan media diskusi atara pimpinan dan pegawai serta media <em>sharing knowledge</em> di lingkungan BPS Provinsi Aceh.</li>\r\n<li>Diselenggarakan setiap hari rabu secara <em>Offline </em>maupun <em>Online </em>dengan peserta yakni pegawai di BPS Provinsi Aceh dan BPS Kabupaten/Kota se Provinsi Aceh.</li>\r\n<li>Dokumentasi dan Notulensi Berapi Tahun 2024 dapat diakses pada alamat: <a href=\"https://drive.bps.go.id/s/iqNYorG3PF56jcL?path=%2FBERAPI\">Kegiatan Berapi</a></li>\r\n</ul>', '<ul>\r\n<li>Setiap Hari Rabu</li>\r\n<li>Kegiatan berapi dilakukan dengan tema yang berbeda setiap minggunya dengan jadwal sebagai berikut:</li>\r\n<li>Minggu 1 : Sharing knowledge bersama kabupaten/kota&nbsp;</li>\r\n<li>Minggu 2 : Internalisasi BerAKHLAK</li>\r\n<li>Minggu 3 : Rabu Aspirasi</li>\r\n<li>Minggu 4 : Internalisasi Indikator Statistik</li>\r\n</ul>', '2024-03-25 02:15:57', '199509142019032002', 'edit', 1, NULL, NULL),
(561, 'AH7zu0iHbD4', '2024s101', 'Pengelolaan Peningkatan Kompetensi Pegawai', '2024', '2024s108', '<p>Ketua:&nbsp;<strong>Yan Yan Gustiana</strong></p>\r\n<p>Anggota:&nbsp;</p>\r\n<p>Maulizasari</p>\r\n<p>Reza Rezki Pulungan</p>\r\n<p>Wahdini</p>\r\n<p>Edo Mara Nasution</p>', '<ol>\r\n<li>Pengisian CKP dilakukan rutin setiap bulan pada KiPApp&nbsp;<em><a href=\"https://webapps.bps.go.id/kipapp\">website kipapp </a></em></li>\r\n</ol>', '<p>KiPApp rutin setiap bulan dengan deadline pengisian di awal bulan</p>', '2024-03-25 02:22:58', '199509142019032002', 'edit', 0, NULL, NULL),
(562, 'GwijEQUfrix', '2024s103', 'Potensi Desa (PODES) 2024', '2024', '2024s102', '<p><strong>Ketua Tim</strong>: Abd.Hakim<br><strong>PJK</strong>: A.Sugito &nbsp; &nbsp;<br><strong>Anggota</strong>: Juliana &nbsp; &nbsp;Fitral &nbsp; &nbsp;M.Ridha &nbsp; &nbsp;Zelvia &nbsp; &nbsp;Maulidya &nbsp; &nbsp;Darwis &nbsp; &nbsp;Mukhlis &nbsp; &nbsp;Bahzur A Chairina</p>', '<p>Pelatihan Inda : <a href=\"https://drive.google.com/drive/folders/1WyZ8NrZMPqlnOrSTCxp1rc-Ub0mjMvI5\">https://drive.google.com/drive/folders/1WyZ8NrZMPqlnOrSTCxp1rc-Ub0mjMvI5</a>&nbsp;</p>', '<table style=\"border-collapse: collapse; width: 671pt;\" border=\"0\" width=\"894\" cellspacing=\"0\" cellpadding=\"0\"><colgroup><col style=\"mso-width-source: userset; mso-width-alt: 16896; width: 363pt;\" width=\"484\"> <col style=\"mso-width-source: userset; mso-width-alt: 14312; width: 308pt;\" width=\"410\"> </colgroup>\r\n<tbody>\r\n<tr style=\"height: 12.5pt;\">\r\n<td class=\"xl67\" style=\"height: 12.5pt; width: 363pt;\" width=\"484\" height=\"17\">Pelatihan Admin LMS&nbsp;</td>\r\n<td class=\"xl68\" style=\"width: 308pt;\" width=\"410\">18-20 Mar 2024</td>\r\n</tr>\r\n<tr style=\"height: 12.5pt;\">\r\n<td class=\"xl65\" style=\"height: 12.5pt; border-top: none;\" height=\"17\">Pelatihan Innas&nbsp;</td>\r\n<td class=\"xl66\" style=\"border-top: none;\">25-29 Mar 2024</td>\r\n</tr>\r\n<tr style=\"height: 12.5pt;\">\r\n<td class=\"xl65\" style=\"height: 12.5pt; border-top: none;\" height=\"17\">Pelatihan Inda&nbsp;</td>\r\n<td class=\"xl66\" style=\"border-top: none;\">1-5 Apr 2024</td>\r\n</tr>\r\n<tr style=\"height: 12.5pt;\">\r\n<td class=\"xl65\" style=\"height: 12.5pt; border-top: none;\" height=\"17\">Pelatihan Petugas&nbsp;</td>\r\n<td class=\"xl66\" style=\"border-top: none;\">22-30 Apr 2024</td>\r\n</tr>\r\n<tr style=\"height: 12.5pt;\">\r\n<td class=\"xl65\" style=\"height: 12.5pt; border-top: none;\" height=\"17\">Pelaksanaan lapangan</td>\r\n<td class=\"xl66\" style=\"border-top: none;\">2