(563, 'nV6yPgVi009', '2024s104', 'Survei Perusahaan Perkebunan', '2024', '2024s104', '<p>Hendra Gunawan</p>\r\n<p>Raiski Ramadhoni</p>', '<ul>\r\n<li>Survei Perusahaan Perkebunan merupakan kegiatan pengumpulan data perkebunan yang dilakukan pada seluruh perusahaan perkebunan yaitu data&nbsp;Perusahaan Perkebunan Negara dan data Perusahaan Perkebunan Swasta di&nbsp;wilayah Republik Indonesia.</li>\r\n<li>Pengumpulan data perusahaan perkebunan&nbsp;dilakukan secara online yang disebut dengan Sedia Data Perusahaan Perkebunan&nbsp;melalui aplikasi SKB Online (SEDAPP Online).</li>\r\n<li>Pengumpulan data Survei Perusahaan Perkebunan dilakukan dengan periode bulanan&nbsp;(Sedapp Online) dan tahunan (SKB Tahunan) dengan Output Luas Tanaman dan Produksi Komoditas.</li>\r\n<li>Jadwal dan direktori Sedapp Online untuk target pencacahan 2024 dapat dilihat pada tautan <a href=\"https://s.bps.go.id/direktori_sedap2024\">https://s.bps.go.id/direktori_sedapp2024</a></li>\r\n<li>Jadwal dan direktori SKB Tahunan untuk target pencacahan 2024 dapat dilihat pada tautan <a href=\"https://s.bps.go.id/direktori_sedap2024\">https://s.bps.go.id/direktori_skb2023</a></li>\r\n<li>Input Data Sedapp Online bulanan dilakukan pada alamat: <a href=\"https://skb.bps.go.id/pb\">https://skb.bps.go.id/pb</a></li>\r\n<li>Input data SKB Tahunan dilakukan pada alamat: <a href=\"https://pengolahan.bps.go.id/produksi/perkebunan/SKB_tahunan\">https://pengolahan.bps.go.id/produksi/perkebunan/SKB_tahunan</a></li>\r\n</ul>', '<ul>\r\n<li>Pengumpulan, Pemeriksaan, dan Pengolahan Data : Setiap Bulan</li>\r\n<li>Tabulasi Data: Angka Tetap 2023 (Mei 2024) dan Angka Sementara 2024 ( September 2024)</li>\r\n</ul>\r\n<p>&nbsp;</p>', '2024-03-25 04:52:23', '198306042006021003', 'edit', 1, NULL, NULL),
(564, 'WD7TLRc7UKe', '2024s101', 'Pengelolaan Implementasi Rencana Aksi Manajemen Perubahan Tahun 2024', '2024', '2024s108', '<p>Ketua : <strong>Yan Yan Gustiana</strong></p>\r\n<p>CC : <strong>Hendra Gunawan</strong></p>\r\n<p>CA :</p>\r\n<p>Wira Junardi</p>\r\n<p>Fikri</p>\r\n<p>Muhammad Hafidz Al Ahmad Bit</p>\r\n<p>Maulizasari</p>\r\n<p>Mazaya Alifah Syadzwina</p>\r\n<p>Anandika Dian Pramesti</p>\r\n<p>&nbsp;</p>', '<ol>\r\n<li>Kegiatan Berapi (Briefing Rabu Pagi) dilakukan setiap hari rabu pagi bersama pimpinan dan seluruh pegawai BPS Provinsi Aceh maupun kabupaten/kota <em><a href=\"https://drive.bps.go.id/s/iqNYorG3PF56jcL?path=%2FBERAPI\">BERAPI</a></em></li>\r\n<li><em>SK dan Surat Tugas CAN periode 2024 BPS Aceh <a href=\"https://drive.bps.go.id/apps/files/?dir=/%5B02.%20Share%20-%20BPS%20Provinsi%20Aceh%5D/08%20Tim%20Tranformasi%20dan%20Budaya%20Organisasi/Change%27s%20Team/Change%20Agents&amp;fileid=28845742\">SK dan Surat Tugas</a></em></li>\r\n<li>Briefing Rabu Pagi (Berapi) merupakan media diskusi atara pimpinan dan pegawai serta media&nbsp;<em>sharing knowledge</em>&nbsp;di lingkungan BPS Provinsi Aceh.</li>\r\n<li>Diselenggarakan setiap hari rabu secara&nbsp;<em>Offline&nbsp;</em>maupun&nbsp;<em>Online&nbsp;</em>dengan peserta yakni pegawai di BPS Provinsi Aceh dan BPS Kabupaten/Kota se Provinsi Aceh.</li>\r\n<li>Dokumentasi dan Notulensi Berapi Tahun 2024 dapat diakses pada alamat:&nbsp;<a href=\"https://drive.bps.go.id/s/iqNYorG3PF56jcL?path=%2FBERAPI\">Kegiatan Berapi</a></li>\r\n</ol>', '<ol>\r\n<li>Kegiatan Berapi dilakukan setiap hari Rabu&nbsp; <em><a href=\"https://drive.bps.go.id/apps/onlyoffice/s/iqNYorG3PF56jcL?fileId=27849405\">Jadwal BERAPI 2024</a></em></li>\r\n<li>Berapi dilakukan dengan tema yang berbeda setiap minggunya dengan jadwal sebagai berikut:</li>\r\n<li>Minggu 1 : Sharing knowledge bersama kabupaten/kota&nbsp;</li>\r\n<li>Minggu 2 : Internalisasi BerAKHLAK</li>\r\n<li>Minggu 3 : Rabu Aspirasi</li>\r\n<li>Minggu 4 : Internalisasi Indikator Statistik</li>\r\n<li>&nbsp;</li>\r\n</ol>', '2024-03-26 01:55:16', '199509142019032002', 'edit', 0, NULL, NULL),
