(567, 'Gr1FwOO7rX8', '2024s101', 'Penyusunan Perjanjian Kinerja BPS Provinsi Aceh Tahun 2024', '2024', '2024s101', '<p>Reza Rezki Pulungan</p>\r\n<p>Kanasha Humaira</p>', '<p><strong>Perjanjian kinerja</strong>&nbsp;adalah lembar/<strong>dokumen</strong>&nbsp;yang berisikan penugasan dari pimpinan instansi yang lebih tinggi kepada pimpinan instansi yang lebih rendah untuk melaksanakan program/kegiatan yang disertai dengan indikator&nbsp;<strong>kinerja</strong>.</p>\r\n<p>Dokumen terkait penyusunan Perjanjian Kinerja 2024 dapat diakses pada tautan&nbsp;<a href=\"https://s.id/PK2024_Aceh\">http://s.id/PK2024_Aceh</a></p>', '<table style=\"border-collapse: collapse; width: 69.694%;\" border=\"1\"><colgroup><col style=\"width: 50.5159%;\"><col style=\"width: 49.4841%;\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>Kegiatan</strong></td>\r\n<td style=\"text-align: center;\"><strong>Tanggal</strong></td>\r\n</tr>\r\n<tr>\r\n<td>1. Pelaporan target PK 2024</td>\r\n<td>paling lambat 30 Januari 2024</td>\r\n</tr>\r\n<tr>\r\n<td>2. Penandatanganan PK 2024</td>\r\n<td>29 Januari 2024</td>\r\n</tr>\r\n<tr>\r\n<td>3. Upload pada Si Monev BPS</td>\r\n<td>Paling lambat 13 Februari 2024&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>4. Upload&nbsp; E SAKIP REVIU MENPAN</td>\r\n<td>Paling lambat 13 Februari 2024</td>\r\n</tr>\r\n</tbody>\r\n</table>', '2024-03-26 05:18:22', '198504232008011001', 'baru', 1, NULL, NULL),
