(592, 'RgcRLwR8Dqh', '2024s106', 'Survei Khusus Triwulan Neraca Prodkusi (SKTNP)', '2024', '2024s106', '<p><strong>Ketua Tim:</strong> Meita Jumiartanti</p>\r\n<ul>\r\n<li><strong>PIC SKTNP:</strong> Fitri Mulyani</li>\r\n<li><strong>Anggota:</strong> Ridha Mutia &amp; Azwar&nbsp;</li>\r\n</ul>', '<p><strong>Tujuan Survei</strong></p>\r\n<p><em>Survei ini bertujuan untuk memperoleh informasi terkini dan tercepat mengenai perkembangan indikator produksi, tenaga kerja, indikator harga dan pendapatan/output yang akan digunakan dalam&nbsp;penyusunan PDB/PDRB triwulanan lapangan usaha barang dan jasa. Kegiatan usaha yang menjadi fokus SKTNP 2024 adalah kegiatan usaha yang belum memiliki indikator produksi yang rutin dalam penyusunan PDB/PDRB triwulanan. Indikator produksi tersebut akan diperoleh dengan cara melihat perkembangan perusahaan/usaha. Perusahaan/usaha yang terpilih menjadi sampel akan disurvei selama <strong>empat kali periode pencacahan dalam satu tahun kegiatan.</strong></em></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Dokumentasi Kegiatan</strong></p>\r\n<p><a href=\"s.bps.go.id/KAK-SKDNP\">s.bps.go.id/KAK-SKDNP</a></p>\r\n<p style=\"line-height: 1;\"><strong>Link Bahan Ajar</strong></p>\r\n<p><a href=\"s.bps.go.id/BahanPelatihanSKDNP24\">s.bps.go.id/BahanPelatihanSKDNP24</a></p>\r\n<p><strong>QnA Pelatihan Inda</strong></p>\r\n<p><a href=\"http://s.bps.go.id/QnA-Pelatihan-Inda\" target=\"_blank\" rel=\"noopener\">s.bps.go.id/QnA-Pelatihan-Inda</a> &nbsp;</p>', '<table style=\"border-collapse: collapse; width: 82.3324%; height: 134.344px;\" border=\"1\"><colgroup><col style=\"width: 14.3281%;\"><col style=\"width: 85.6719%;\"></colgroup>\r\n<tbody>\r\n<tr style=\"height: 44.7812px;\">\r\n<td style=\"height: 44.7812px; text-align: center;\" colspan=\"2\"><strong>Pelaksanaan Lapangan (Pengumpulan &amp; Pengawasan)&nbsp;</strong></td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"height: 22.3906px;\">Data Triwulan IV 2023</td>\r\n<td style=\"height: 22.3