(598, 'rIYNWnH6SXI', '2024s106', 'Survei Neraca Terintegrasi (SINASI)', '2024', '2024s106', '<p><strong>Ketua Tim:</strong>&nbsp;Meita Jumiartanti</p>\r\n<ul>\r\n<li><strong>PIC SINASI:</strong>&nbsp;Fitri Mulyani</li>\r\n<li><strong>Anggota:</strong> Ridha Mutia, Azwar</li>\r\n</ul>', '<p><strong>Tujuan Survei</strong></p>\r\n<p style=\"text-align: justify;\"><em>Survei Neraca Terintegrasi pada tahun 2024 ini bertujuan untuk </em><em>memperoleh informasi terbaru mengenai parameter yang akan digunakan </em><em>dalam penyusunan PDB, SUT, dan Tabel I-O. Tujuan dari survei ini adalah </em><em>memperoleh data dan informasi yang akan digunakan untuk penyusunan </em><em>matriks margin perdagangan dan pengangkutan (Trade and Transport Margin/TTM), struktur pendapatan, serta struktur pengeluaran </em><em>usaha/perusahaan.&nbsp;</em></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p><strong>Dokumentasi Kegiatan</strong></p>\r\n<p><a href=\"s.bps.go.id/KAK-SKDNP\">s.bps.go.id/KAK-SKDNP</a></p>\r\n<p><strong>Link Bahan Ajar</strong></p>\r\n<p><a href=\"s.bps.go.id/BahanPelatihanSKDNP24\">s.bps.go.id/BahanPelatihanSKDNP24</a></p>\r\n<p><strong>QnA Pelatihan Inda</strong></p>\r\n<p><a href=\"http://s.bps.go.id/QnA-Pelatihan-Inda\" target=\"_blank\" rel=\"noopener\">s.bps.go.id/QnA-Pelatihan-Inda</a> &nbsp;</p>', '<p><strong>Pelatihan Petugas &gt;&gt;</strong> 3-7 Maret 2024</p>\r\n<p><strong>Pendataan Lapangan &gt;&gt;</strong> Mei-Oktober 2024</p>', '2024-05-28 03:28:52', '199503172018022001', 'edit', 1, '2024-05-28 10:28:52', '2024-05-28 10:28:52'),
(599, 'aKSOJV6uBF1', '2024s106', 'Indepth Study SEEA', '2024', '2024s106', '<div class=\"card-body\">\r\n<p><strong>Ketua Tim:</strong>&nbsp;Meita Jumiartanti</p>\r\n<ul>\r\n<li><strong>PIC SINASI:</strong>&nbsp;Fitri Mulyani</li>\r\n<li><strong>Anggota:</strong> Ridha Mutia, Azwar</li>\r\n</ul>\r\n</div>', '<p style=\"text-align: justify;\"><strong>Tujuan Kegiatan</strong><br><em>In-depth Study</em> SEEA tahun 2023 bermaksud untuk memperoleh data/informasi mengenai keanekaragaman hayati dan perubahan iklim di Indonesia, khususnya yang berkaitan dengan dimensi ekonomi dan lingkungan. Oleh karena itu, pada tahun ini BPS menyelenggarakan in-depth study yang memiliki tujuan-tujuan sebagai berikut:&nbsp;<br>a. Mengetahui jumlah flora dan fauna serta perubahannya menurut jenis spesies&nbsp;<br>b. Mengetahui pemanfaatan keanekaragaman hayati dalam ekonomi&nbsp;<br>c. Mengetahui penyediaan produk-produk energi&nbsp;<br>d. Mengetahui penggunaan bahan bakar dan produk energi yang dapat menghasilkan emisi gas rumah kaca&nbsp;</p>', '<p><strong>Pelatihan Petugas &gt;&gt;</strong> 24-28 Juni 2024</p>\r\n<p><strong>Pendataan Lapangan &gt;&gt;</strong> Mei-Oktober 2024</p>', '2024-05-28 03:31:01', '199503172018022001', 'edit', 1, '2024-05-28 10:31:01', '2024-05-28 10:31:01');
