(62, 'nyIk04t9ZvK', '', '2024-01-15', 'Pelatihan Inda Sakernas Februari 2024', 'WhatsApp_Image_2024-01-15_at_09_19_08.jpeg', '<p>Untuk dokumentasi lengkap dapat dilihat melalui link : <a href=\"https://s.id/dokumentasi-sakfeb24\">https://s.id/dokumentasi-sakfeb24</a>&nbsp; &nbsp;( folder dokumentasi)</p>\r\n<p>Penanggung Jawab Pelatihan: Abd.Hakim<br>Pengelola Kelas: Maulidya dan Munandar<br>Administrasi/Pendukung : Muhammad Ridha<br>Penanggung jawab LMS : Ika Virnaristanti, S.Si, M.Si</p>\r\n<p>Innas Kelas A : Kahar Muzzakar &amp; Darwis Abubakar<br>Innas Kelas B: Dina Nirmala Sari &amp; Muhammad Iqbal Iradah</p>\r\n<p>Pelatihan Inda Sakernas Februari 2024 dilaksanakan secara online menggunakan LMS WARKOP yang dikelola oleh Pusdiklat BPS selama 4 hari efektif. Untuk pelatihan Inda dilaksanakan pada periode tanggal 15-18 Januari 2024</p>', '2024-02-15 13:54:50', '198109132006021001', 'update', 0, NULL, NULL),
