(103, 'nyIk04t9ZvK', '', '2024-01-15', 'Pelatihan Inda Sakernas Februari 2024', 'WhatsApp_Image_2024-01-15_at_09_19_08.jpeg', '<p>Pelatihan Inda Sakernas Februari 2024 dilaksanakan secara online menggunakan LMS WARKOP yang dikelola oleh Pusdiklat BPS selama 4 hari efektif, pada tanggal 15-18 Januari 2024.</p>\r\n<p>Penanggung Jawab Pelatihan: Abd.Hakim<br>Pengelola Kelas: Maulidya dan Munandar<br>Administrasi/Pendukung : Muhammad Ridha<br>Penanggung jawab LMS : Ika Virnaristanti, S.Si, M.Si</p>\r\n<p>Innas Kelas A : Kahar Muzzakar &amp; Darwis Abubakar<br>Innas Kelas B: Dina Nirmala Sari &amp; Muhammad Iqbal Iradah</p>\r\n<p>Jumlah Inda sebanyak : 52 Orang, dan seluruhnya dinyatakan LULUS MENGAJAR</p>\r\n<p>Untuk dokumentasi lengkap dapat dilihat melalui link : https://drive.google.com/drive/u/2/folders/1Mz7kCp4bO2WPuo9bjaw9ZExMLd5K2lGV</p>', '2024-02-20 08:17:50', '198109132006021001', 'update', 0, NULL, NULL),
