(107, 'ur3FwpQOqIH', 'SSzViDQnobN', '2023-12-11', 'Pelatihan Pembina Statistik Sektoral Tahap 1', NULL, '<p>Pelatihan Pembina Statistik Sektoral Tahap 1&nbsp;(Pelatihan PSS Tahap 1) diselenggarakan Pusdiklat BPS berkolaborasi dengan Direktorat&nbsp;<br>Diseminasi Statistik.</p>\r\n<p>1. Pelatihan telah diikuti 164 peserta yang terdiri dari 104 peserta sebagai Tim Pembina dari BPS Provinsi dan 60 peserta sebagai Tim Pembina dari BPS RI. Peserta terbagi menjadi 4 kelas.&nbsp;<br>2. Peserta telah mengikuti pembelajaran sebanyak 37 Jam Pembelajaran (JP) dengan rincian;&nbsp;<br>a. Overviu secara daring pada tanggal 5 Desember 2023 sebanyak 4 JP, &nbsp;<br>b. Pembelajaran Mandiri (Massive Open Online Course/MOOC) pada tanggal 5 s.d. 8 Desember 2023 sebanyak 6 JP, dan&nbsp;<br>c. Pembelajaran Klasikal di Pusdiklat tanggal 11 s.d. 13 Desember 2023 sebanyak 27 JP.&nbsp;<br>3. Output yang diharapkan melalui pelatihan ini adalah Tim Pembina Statistik Sektoral di BPS RI dan BPS Provinsi memiliki kemampuan dan kompetensi;&nbsp;<br>a. Menjadi pengajar/fasilitator pada Pelatihan Pembina Statistik Sektoral Tahap 2 yang akan diikuti oleh Tim Pembina Statistik Sektoral dari seluruh BPS Kabupaten/Kota.&nbsp;<br>b. Menjalankan tugas sebagai Tim Pembina Statistik Sektoral.&nbsp;<br>c. Khusus untuk Tim Pembina Statistik Sektoral di tingkat BPS Provinsi, peserta diharapkan mampu mengkoordinasikan pembinaan statistik sektoral di kabupaten/kota wilayahnya masing-masing.&nbsp;</p>', '2024-02-20 09:29:42', '198804162008011001', 'baru', 0, NULL, NULL),
(108, 'wjyz2zdnxLb', '', '2023-12-11', 'Pelatihan Pembina Statistik Sektoral Tahap 1', NULL, '<p>Pelatihan Pembina Statistik Sektoral Tahap 1 (Pelatihan PSS Tahap 1) diselenggarakan Pusdiklat BPS berkolaborasi dengan Direktorat&nbsp;Diseminasi Statistik.</p>\r\n<p>1. Pelatihan telah diikuti 164 peserta yang terdiri dari 104 peserta sebagai Tim Pembina dari BPS Provinsi dan 60 peserta sebagai Tim Pembina dari BPS RI. Peserta terbagi menjadi 4 kelas.&nbsp;<br>2. Peserta telah mengikuti pembelajaran sebanyak 37 Jam Pembelajaran (JP) dengan rincian;&nbsp;<br>a. Overviu secara daring pada tanggal 5 Desember 2023 sebanyak 4 JP, &nbsp;<br>b. Pembelajaran Mandiri (Massive Open Online Course/MOOC) pada tanggal 5 s.d. 8 Desember 2023 sebanyak 6 JP, dan&nbsp;<br>c. Pembelajaran Klasikal di Pusdiklat tanggal 11 s.d. 13 Desember 2023 sebanyak 27 JP.&nbsp;<br>3. Output yang diharapkan melalui pelatihan ini adalah Tim Pembina Statistik Sektoral di BPS RI dan BPS Provinsi memiliki kemampuan dan kompetensi;&nbsp;<br>a. Menjadi pengajar/fasilitator pada Pelatihan Pembina Statistik Sektoral Tahap 2 yang akan diikuti oleh Tim Pembina Statistik Sektoral dari seluruh BPS Kabupaten/Kota.&nbsp;<br>b. Menjalankan tugas sebagai Tim Pembina Statistik Sektoral.&nbsp;<br>c. Khusus untuk Tim Pembina Statistik Sektoral di tingkat BPS Provinsi, peserta diharapkan mampu mengkoordinasikan pembinaan statistik sektoral di kabupaten/kota wilayahnya masing-masing.&nbsp;</p>', '2024-02-20 09:30:43', '198804162008011001', 'update', 0, NULL, NULL),
(109, 'KPQAAV5xcwL', 'SSzViDQnobN', '2024-01-05', 'Pelatihan Pembina Statistik Sektoral Tahap 2', NULL, '<p>Menindaklanjuti Surat Deputi Bidang Metodologi dan Informasi Statistik Nomor B-372/03000/PS.100/11/2023 Tanggal 15 November 2023 perihal Permintaan Tim Pembina Statistik Sektoral Tingkat Daerah, disampaikan beberapa hal sebagai berikut:&nbsp;<br>1. Pelatihan Pembina Statistik Sektoral Tahap 2 akan dilaksanakan mulai 5 Januari 2024 melalui E-WARKOP Pusdiklat BPS.&nbsp;<br>2. Peserta pelatihan dan alokasi peserta menurut provinsi dapat diakses pada <a href=\"http://s.bps.go.id/pss2_adminbangkom\">http://s.bps.go.id/pss2_adminbangkom</a>&nbsp;<br>3. Alokasi fasilitator diserahkan kepada masing-masing BPS Provinsi dengan mempertimbangkan kombinasi fasilitator provinsi dan pusat.&nbsp;<br>4. Untuk optimalisasi jumlah peserta pada kelas yang belum mencapai 25 (dua puluh lima) orang, dimohon agar dapat menambahkan peserta dari BPS Provinsi dan/atau BPS Kabupaten/Kota yang bersesuaian di kelas tersebut dengan kuota peserta 25-40 orang. Mekanisme penambahan peserta dapat melalui http://s.bps.go.id/pss2_adminbangkom. &nbsp;<br>5. Untuk kelancaran pelatihan, BPS Provinsi dimohon dapat menugaskan 1 (satu) pegawai sebagai Manajer Kelas untuk masing-masing kelas.&nbsp;<br>6. Administrator Pengembangan Kompetensi (Admin Bangkom) dan Manajer Kelas agar dapat mengikuti rapat persiapan pada:&nbsp;<br>Hari/Tanggal : Jumat, 22 Desember 2023 &nbsp;<br>Jam &nbsp;: 07:30 WIB - selesai&nbsp;<br>Tempat : Zoom meeting &nbsp;dengan &nbsp;ID: 99488697722 Password: pss2&nbsp;<br>7. Nama-nama peserta tambahan dan manajer kelas agar dapat kami terima melalui link tersebut di atas paling lambat Selasa, 27 Desember 2023.&nbsp;</p>', '2024-02-20 09:40:46', '198804162008011001', 'baru', 0, NULL, NULL),
