(127, 'wjyz2zdnxLb', '', '2023-12-11', 'Pelatihan Pembina Statistik Sektoral Tahap 1', 'Pembukaan_page-00011.jpg', '<p>Pelatihan Pembina Statistik Sektoral Tahap 1 (Pelatihan PSS Tahap 1) diselenggarakan Pusdiklat BPS berkolaborasi dengan Direktorat&nbsp;Diseminasi Statistik.</p>\r\n<p>Pembukaan Pelatihan Pembinaan Statistik Sektoral Tahap 1 (Tingkat Pusat dan Provinsi) di Pusdiklat Badan Pusat Statistik <a href=\"https://youtu.be/ustFuX6-GHo\">https://youtu.be/ustFuX6-GHo</a></p>\r\n<p>1. Pelatihan telah diikuti 164 peserta yang terdiri dari 104 peserta sebagai Tim Pembina dari BPS Provinsi dan 60 peserta sebagai Tim Pembina dari BPS RI. Peserta terbagi menjadi 4 kelas.&nbsp;<br>2. Peserta telah mengikuti pembelajaran sebanyak 37 Jam Pembelajaran (JP) dengan rincian;&nbsp;<br>a. Overviu secara daring pada tanggal 5 Desember 2023 sebanyak 4 JP, &nbsp;<br>b. Pembelajaran Mandiri (Massive Open Online Course/MOOC) pada tanggal 5 s.d. 8 Desember 2023 sebanyak 6 JP, dan&nbsp;<br>c. Pembelajaran Klasikal di Pusdiklat tanggal 11 s.d. 13 Desember 2023 sebanyak 27 JP.&nbsp;<br>3. Output yang diharapkan melalui pelatihan ini adalah Tim Pembina Statistik Sektoral di BPS RI dan BPS Provinsi memiliki kemampuan dan kompetensi;&nbsp;<br>a. Menjadi pengajar/fasilitator pada Pelatihan Pembina Statistik Sektoral Tahap 2 yang akan diikuti oleh Tim Pembina Statistik Sektoral dari seluruh BPS Kabupaten/Kota.&nbsp;<br>b. Menjalankan tugas sebagai Tim Pembina Statistik Sektoral.&nbsp;<br>c. Khusus untuk Tim Pembina Statistik Sektoral di tingkat BPS Provinsi, peserta diharapkan mampu mengkoordinasikan pembinaan statistik sektoral di kabupaten/kota wilayahnya masing-masing.&nbsp;</p>', '2024-02-20 15:25:54', '198804162008011001', 'update', 0, NULL, NULL),
(128, 'wjyz2zdnxLb', '', '2023-12-11', 'Pelatihan Pembina Statistik Sektoral Tahap 1', 'Pembukaan_page-00011.jpg', '<p>Pelatihan Pembina Statistik Sektoral Tahap 1 (Pelatihan PSS Tahap 1) diselenggarakan Pusdiklat BPS berkolaborasi dengan Direktorat&nbsp;Diseminasi Statistik.</p>\r\n<p>Pembukaan Pelatihan Pembinaan Statistik Sektoral Tahap 1 (Tingkat Pusat dan Provinsi) di Pusdiklat Badan Pusat Statistik. <a href=\"https://youtu.be/ustFuX6-GHo\">https://youtu.be/ustFuX6-GHo</a></p>\r\n<p>1. Pelatihan telah diikuti 164 peserta yang terdiri dari 104 peserta sebagai Tim Pembina dari BPS Provinsi dan 60 peserta sebagai Tim Pembina dari BPS RI. Peserta terbagi menjadi 4 kelas.&nbsp;<br>2. Peserta telah mengikuti pembelajaran sebanyak 37 Jam Pembelajaran (JP) dengan rincian;&nbsp;<br>a. Overviu secara daring pada tanggal 5 Desember 2023 sebanyak 4 JP, &nbsp;<br>b. Pembelajaran Mandiri (Massive Open Online Course/MOOC) pada tanggal 5 s.d. 8 Desember 2023 sebanyak 6 JP, dan&nbsp;<br>c. Pembelajaran Klasikal di Pusdiklat tanggal 11 s.d. 13 Desember 2023 sebanyak 27 JP.&nbsp;<br>3. Output yang diharapkan melalui pelatihan ini adalah Tim Pembina Statistik Sektoral di BPS RI dan BPS Provinsi memiliki kemampuan dan kompetensi;&nbsp;<br>a. Menjadi pengajar/fasilitator pada Pelatihan Pembina Statistik Sektoral Tahap 2 yang akan diikuti oleh Tim Pembina Statistik Sektoral dari seluruh BPS Kabupaten/Kota.&nbsp;<br>b. Menjalankan tugas sebagai Tim Pembina Statistik Sektoral.&nbsp;<br>c. Khusus untuk Tim Pembina Statistik Sektoral di tingkat BPS Provinsi, peserta diharapkan mampu mengkoordinasikan pembinaan statistik sektoral di kabupaten/kota wilayahnya masing-masing.&nbsp;</p>', '2024-02-20 16:05:21', '198804162008011001', 'update', 0, NULL, NULL),
