(137, 'qiOuDqRKMvn', '', '2024-01-29', 'Kick Off Pembinaan Statistik Sektoral Kementerian/Lembaga', 'Kick_page-0001-min.jpg', '<p>&ldquo;Setiap kita menghasilkan data statistik, kita pasti menginginkan data yang berkualitas. Maka dalam proses pembinaan statistik ini kita berupaya mendorong kementerian/lembaga (K/L) menghasilkan data yang berkualitas. Untuk menghasilkan data prioritas yang berkualitas, BPS melakukan pembinaan, yaitu pembinaan dari sisi proses, kualitas data, kelembagaan dan SDM, serta sistem statistik nasional,&rdquo; ujar Deputi Bidang Metodologi dan Informasi Statistik BPS, Imam Machdi saat membuka kegiatan \"Kick Off Pembinaan Statistik Sektoral Kementerian/Lembaga&rdquo; di Jakarta (29/1). <span style=\"font-size: 12pt; color: rgb(35, 111, 161);\"><a style=\"color: rgb(35, 111, 161);\" href=\"https://www.instagram.com/p/C2tPoHJyQzT/?igsh=MTZubDlyMzRtMXoydA==\">https://www.instagram.com/p/C2tPoHJyQzT/?igsh=MTZubDlyMzRtMXoydA==</a></span></p>\r\n<p>Pembinaan Statistik Sektoral yang dilakukan BPS sebagai pembina data statistik sesuai amanat Perpres No. 39 Tahun 2019 tentang Satu Data Indonesia.</p>', '2024-02-21 12:05:52', '198804162008011001', 'update', 0, NULL, NULL),
(138, 'qiOuDqRKMvn', '', '2024-01-29', 'Kick Off Pembinaan Statistik Sektoral Kementerian/Lembaga', 'Kick_page-0001-min.jpg', '<p>&ldquo;Setiap kita menghasilkan data statistik, kita pasti menginginkan data yang berkualitas. Maka dalam proses pembinaan statistik ini kita berupaya mendorong kementerian/lembaga (K/L) menghasilkan data yang berkualitas. Untuk menghasilkan data prioritas yang berkualitas, BPS melakukan pembinaan, yaitu pembinaan dari sisi proses, kualitas data, kelembagaan dan SDM, serta sistem statistik nasional,&rdquo; ujar Deputi Bidang Metodologi dan Informasi Statistik BPS, Imam Machdi saat membuka kegiatan \"Kick Off Pembinaan Statistik Sektoral Kementerian/Lembaga&rdquo; di Jakarta (29/1). <span style=\"font-size: 10pt; color: rgb(52, 73, 94);\"><a style=\"color: rgb(52, 73, 94);\" href=\"https://www.instagram.com/p/C2tPoHJyQzT/?igsh=MTZubDlyMzRtMXoydA==\">https://www.instagram.com/p/C2tPoHJyQzT/?igsh=MTZubDlyMzRtMXoydA==</a></span></p>\r\n<p>Pembinaan Statistik Sektoral yang dilakukan BPS sebagai pembina data statistik sesuai amanat Perpres No. 39 Tahun 2019 tentang Satu Data Indonesia.</p>', '2024-02-21 12:06:54', '198804162008011001', 'update', 0, NULL, NULL),
