(142, 'wjyz2zdnxLb', '', '2023-12-11', 'Pelatihan Pembina Statistik Sektoral Tahap 1', 'Pembukaan_page-00011.jpg', '<p>Pelatihan Pembina Statistik Sektoral Tahap 1 (Pelatihan PSS Tahap 1) diselenggarakan Pusdiklat BPS berkolaborasi dengan Direktorat&nbsp;Diseminasi Statistik.</p>\r\n<p>Pembukaan Pelatihan Pembinaan Statistik Sektoral Tahap 1 (Tingkat Pusat dan Provinsi) di Pusdiklat Badan Pusat Statistik. <span style=\"color: rgb(35, 111, 161);\"><a style=\"color: rgb(35, 111, 161);\" href=\"https://youtu.be/ustFuX6-GHo\">https://youtu.be/ustFuX6-GHo</a></span></p>\r\n<p>1. Pelatihan telah diikuti 164 peserta yang terdiri dari 104 peserta sebagai Tim Pembina dari BPS Provinsi dan 60 peserta sebagai Tim Pembina dari BPS RI. Peserta terbagi menjadi 4 kelas.&nbsp;<br>2. Peserta telah mengikuti pembelajaran sebanyak 37 Jam Pembelajaran (JP) dengan rincian;&nbsp;<br>a. Overviu secara daring pada tanggal 5 Desember 2023 sebanyak 4 JP, &nbsp;<br>b. Pembelajaran Mandiri (Massive Open Online Course/MOOC) pada tanggal 5 s.d. 8 Desember 2023 sebanyak 6 JP, dan&nbsp;<br>c. Pembelajaran Klasikal di Pusdiklat tanggal 11 s.d. 13 Desember 2023 sebanyak 27 JP.&nbsp;<br>3. Output yang diharapkan melalui pelatihan ini adalah Tim Pembina Statistik Sektoral di BPS RI dan BPS Provinsi memiliki kemampuan dan kompetensi;&nbsp;<br>a. Menjadi pengajar/fasilitator pada Pelatihan Pembina Statistik Sektoral Tahap 2 yang akan diikuti oleh Tim Pembina Statistik Sektoral dari seluruh BPS Kabupaten/Kota.&nbsp;<br>b. Menjalankan tugas sebagai Tim Pembina Statistik Sektoral.&nbsp;<br>c. Khusus untuk Tim Pembina Statistik Sektoral di tingkat BPS Provinsi, peserta diharapkan mampu mengkoordinasikan pembinaan statistik sektoral di kabupaten/kota wilayahnya masing-masing.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>Link Dokumentasi &nbsp;Pelatihan Pembina Statistik Sektoral Tahap 1:</strong><br><a href=\"https://pusdiklatbps.quickconnect.to/d/s/wNzt76oZw1MMhkOpUqeRIfVSLWpWtHN5/lTZSQUt6YFO929LkyGwxKOkFS065iqM6-vrWAh_00-Ao\">https://pusdiklatBPS.quickconnect.to/d/s/wNzt76oZw1MMhkOpUqeRIfVSLWpWtHN5/lTZSQUt6YFO929LkyGwxKOkFS065iqM6-vrWAh_00-Ao</a></p>', '2024-02-21 12:17:50', '198804162008011001', 'update', 0, NULL, NULL),
(143, 'y6DppZRa72N', '', '2024-01-05', 'Pelatihan Pembina Statistik Sektoral Tahap 2', '212_page-0001.jpg', '<p style=\"line-height: 1.4;\">Menindaklanjuti Surat Deputi Bidang Metodologi dan Informasi Statistik Nomor B-372/03000/PS.100/11/2023 Tanggal 15 November 2023 perihal Permintaan Tim Pembina Statistik Sektoral Tingkat Daerah, disampaikan bahwa pelatihan Pembina Statistik Sektoral Tahap 2 akan dilaksanakan mulai 5 Januari 2024 melalui E-WARKOP Pusdiklat BPS.&nbsp;</p>', '2024-02-21 12:20:41', '198804162008011001', 'update', 0, NULL, NULL),
(144, 'BuvIPZAlRL9', 'SSzViDQnobN', '2024-02-19', 'ESENSIAL: Edukasi Seputar Pembinaan Statistik Sektoral', 'esen_page-0001.jpg', '<p>Dalam rangka penguatan SDM Pembinaan Statistik Sektoral (PSS), Sekretariat PSS BPS menyelenggarakan internalisasi bertajuk ESENSIAL: Edukasi Seputar Pembinaan Statistik Sektoral.<br>Esensial edisi perdana ini akan membahas 3 agenda sekaligus, yaitu Standar Data Statistik, Metadata Statistik, dan Rekomendasi Kegiatan Statistik, bersama para fasilitator yang ahli di bidangnya.</p>\r\n<p>ESENSIAL: Edukasi Seputar Pembinaan Statistik Sektoral:&nbsp;<a href=\"https://s.id/pss-esensial\">https://s.id/pss-esensial</a></p>', '2024-02-21 12:30:11', '198804162008011001', 'baru', 0, NULL, NULL),
(145, 'qiOuDqRKMvn', '', '2024-01-29', 'Kick Off Pembinaan Statistik Sektoral Kementerian/Lembaga', 'Kick_page-0001-min.jpg', '<p>&ldquo;Setiap kita menghasilkan data statistik, kita pasti menginginkan data yang berkualitas. Maka dalam proses pembinaan statistik ini kita berupaya mendorong kementerian/lembaga (K/L) menghasilkan data yang berkualitas. Untuk menghasilkan data prioritas yang berkualitas, BPS melakukan pembinaan, yaitu pembinaan dari sisi proses, kualitas data, kelembagaan dan SDM, serta sistem statistik nasional,&rdquo; ujar Deputi Bidang Metodologi dan Informasi Statistik BPS, Imam Machdi saat membuka kegiatan \"Kick Off Pembinaan Statistik Sektoral Kementerian/Lembaga&rdquo; di Jakarta (29/1). Pembinaan Statistik Sektoral yang dilakukan BPS sebagai pembina data statistik sesuai amanat Perpres No. 39 Tahun 2019 tentang Satu Data Indonesia.</p>\r\n<p><span style=\"font-size: 10pt; color: rgb(52, 73, 94);\"><a style=\"color: rgb(52, 73, 94);\" href=\"https://www.instagram.com/p/C2tPoHJyQzT/?igsh=MTZubDlyMzRtMXoydA==\">https://www.instagram.com/p/C2tPoHJyQzT/?igsh=MTZubDlyMzRtMXoydA==</a></span></p>', '2024-02-21 12:31:49', '198804162008011001', 'update', 0, NULL, NULL),
(146, 'y6DppZRa72N', '', '2024-01-05', 'Pelatihan Pembina Statistik Sektoral Tahap 2', '212_page-0001.jpg', '<p style=\"line-height: 1.4;\">Menindaklanjuti Surat Deputi Bidang Metodologi dan Informasi Statistik Nomor B-372/03000/PS.100/11/2023 Tanggal 15 November 2023 perihal Permintaan Tim Pembina Statistik Sektoral Tingkat Daerah, disampaikan bahwa pelatihan Pembina Statistik Sektoral Tahap 2 akan dilaksanakan mulai 5 Januari 2024 melalui E-WARKOP Pusdiklat BPS.</p>\r\n<p style=\"line-height: 1.4;\"><strong>Rekaman Zoom Pelatihan PSS - Aceh: &nbsp;</strong><a href=\"https://www.youtube.com/playlist?list=PL96OlKj4P3HLOJhd4G1kEOVHrrZsel6hg\">https://www.youtube.com/playlist?list=PL96OlKj4P3HLOJhd4G1kEOVHrrZsel6hg</a></p>', '2024-02-21 12:32:57', '198804162008011001', 'update', 0, NULL, NULL),
(147, 'ZgbITjMzFsk', 'cBx8wcIIumn', '2024-02-20', 'pekerjaan-pekerjaan yang dilakukan', NULL, '<ul>\r\n<li>Hasil pengetesan, diperlukan settingan IP pc dan perangkat dari mode Static ke Mode DCHP agar perangkat wifi dan pc tidak terjadi duplikat dalam alokasi IP</li>\r\n<li>Konfigurasi dikembalikan ke settingan awal untuk menghindari terjadikan permasalahan pada user sambil menunggu perangkat wifi yang lebih handal</li>\r\n</ul>', '2024-02-21 15:50:23', '198012212010031001', 'baru', 0, NULL, NULL),
