(163, '2wDt0SPvxT3', 'wBMvH50bTcd', '2024-01-25', 'Pembuatan database pengguna layanan PST', NULL, '<p><a title=\"Link database pengguna layanan PST\" href=\"https://drive.bps.go.id/apps/onlyoffice/25510309?filePath=%2F%5B02.%20Share%20-%20BPS%20Provinsi%20Aceh%5D%2F08%20Tim%20Tranformasi%20dan%20Budaya%20Organisasi%2F3.%20Digitalisasi%20Layanan%20dan%20Inovasi%2FJanuari%2FDatabase%2FDatabase%20Pengguna%20Data%202023.xlsx\">Link database pengguna</a> digunakan sebagai alamat email untuk melakukan email blast</p>', '2024-02-23 09:18:08', '199607132019012002', 'baru', 0, NULL, NULL),
(164, 'jMn0tzajjSY', 'wBMvH50bTcd', '2024-02-01', 'Pembuatan Microsite email blast', NULL, '<p>Email database pengguna layanan PST digunakan untuk menjadi email tujuan pengiriman email blast setiap BPS Provinsi Aceh melakukan Rilis Berita Resmi Statistik (BRS). link yang digunakan adalah <a href=\"http://s.bps.go.id/BRS1100\">http://s.bps.go.id/BRS1100</a></p>', '2024-02-23 09:20:11', '199607132019012002', 'baru', 0, NULL, NULL),
(165, 'bhFSmhuF5D3', 'wBMvH50bTcd', '2024-02-19', 'Pengiriman email blast pertama kali', 'email_blast_feb.jpeg', '<p>Untuk bulan februari, email blast yang dikirim sudah sebanyak 3 kali. dengan judul format berbeda sesuai angka yang di rilis oleh BPS Aceh. Sebagai contoh:</p>\r\n<p>Assalammualaikum Wr.Wb.<br>Halo Sobat Data,<br>Terima kasih telah mengakses dan menggunakan data BPS Aceh.<br>Tahukan Anda, Perkembangan Ekspor dan Impor Aceh, Januari 2024?</p>\r\n<p>Silahkan klik link berikut untuk &nbsp;preferensi media yang Anda minati:</p>\r\n<p>http://s.bps.go.id/BRS1100<br>&nbsp;<br>Hormat Kami,<br>Tim Diseminasi BPS Aceh</p>', '2024-02-23 09:22:31', '199607132019012002', 'baru', 0, NULL, NULL),
(166, 'Bg6tKtfFwUh', 'wBMvH50bTcd', '2024-02-05', 'Pembuatan Angket Layanan Data', 'WhatsApp_Image_2024-02-23_at_9_25_54_AM.jpeg', '<p>Pembuatan angket digunakan untuk melihat minat pengguna apakah memiliki ketertarikan terhadap pembaharuan data yang dilakukan. linknya adalah <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSemyM8rpp0TeAfkI4QyxLOoVLnQd64efJS5uxcFOaQ6Fy5UmQ/viewform\">Link angket ketertarikan BRS</a></p>', '2024-02-23 09:27:33', '199607132019012002', 'baru', 0, NULL, NULL),
