INSERT INTO `zlog_timeline` (`id`, `kode_timeline`, `kode_kegiatan`, `tanggal_timeline`, `judul_timeline`, `image_timeline`, `detail_timeline`, `timestamp`, `nip_pegawai`, `ket`, `flag_kabkot`, `created_at`, `updated_at`) VALUES
(349, '6X6tBx1UVVG', 'WD7TLRc7UKe', '2024-02-28', 'Berapi 28 Februari 2024', 'WhatsApp_Image_2024-02-28_at_08_18_15_(2).jpeg', '<p class=\"docData;DOCY;v5;14902;\"><strong>Internalisasi Indikator Statistik</strong></p>\r\n<p>Materi&nbsp;Statistik&nbsp;Harga&nbsp;Konsumen&nbsp;disampaikan&nbsp;oleh&nbsp;Ibu&nbsp;Titiek&nbsp;Zurriyati (Ketua Tim Statistik&nbsp;Harga, Distribusi&nbsp;dan&nbsp;Jasa).</p>\r\n<p>&nbsp;</p>\r\n<p><strong>IHK</strong></p>\r\n<ul>\r\n<li>\r\n<p>Dihasilkan&nbsp;dari&nbsp;survei&nbsp;harga&nbsp;konsumen, mengukur&nbsp;perubahan rata-rata barang dan jasa</p>\r\n</li>\r\n<li>\r\n<p>Cakupannya 5 kako, Aceh Tamiang, Aceh Tengah, Aceh Barat, Banda Aceh, Lhokseumawe</p>\r\n</li>\r\n<li>\r\n<p>Saat&nbsp;Survei&nbsp;Harga&nbsp;Konsumen di setiap&nbsp;kako&nbsp;berbeda-beda&nbsp;setiap&nbsp;kakonya, sesuai&nbsp;kebutuhan.</p>\r\n</li>\r\n<li>\r\n<p>Dalam&nbsp;pencacahan&nbsp;beberapa&nbsp;hal yang harus&nbsp;diperhatikan&nbsp;antara lain : komoditas, satuan, waktu, lokasi, responden.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>INFLASI</strong></p>\r\n<ul>\r\n<li>\r\n<p>Mengukur&nbsp;stabilitas&nbsp;ekonomi&nbsp;suatu daerah dalam waktu tertentu.</p>\r\n</li>\r\n<li>\r\n<p>Dinamika&nbsp;perubahan&nbsp;harga&nbsp;pola&nbsp;konsumsi&nbsp;masyarakat</p>\r\n</li>\r\n<li>\r\n<p>3 jenis&nbsp;inflasi :</p>\r\n</li>\r\n<li>\r\n<p><em>M</em><em>onth to month</em>, dibulan&nbsp;januari&nbsp;perubahan konsumsi rata-rata dibanding desember</p>\r\n</li>\r\n<li>\r\n<p><em>Y</em><em>ear to date</em>, perubahan&nbsp;relatif IHK november 2023 terhadap&nbsp;desember 2022</p>\r\n</li>\r\n<li>\r\n<p><em>Y</em><em>ear to year</em>, perubahan&nbsp;ihk di bulan&nbsp;januari 2024 terhadap&nbsp;ihk&nbsp;januari 2023</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>IPH (</strong><strong>Indeks</strong><strong>&nbsp;</strong><strong>Perubahan</strong><strong>&nbsp;</strong><strong>H</strong><strong>arga</strong><strong>)</strong></p>\r\n<p>Untuk&nbsp;kab/kota yang tidak&nbsp;ada&nbsp;inflasi, hanya&nbsp;ada 20 komoditas&nbsp;saja, karena&nbsp;sejalan&nbsp;dengan program gerakan&nbsp;nasional&nbsp;pengendalian&nbsp;inflasi&nbsp;pangan.</p>\r\n<p>IPH dilakukan&nbsp;setiap&nbsp;minggu</p>\r\n<p>Rakor inflasi dilakukan setiap minggu</p>', '2024-03-26 08:58:15', '199509142019032002', 'baru', 1, NULL, NULL),
(350, 'Ve1RhJAKHI8', 'WD7TLRc7UKe', '2024-02-28', 'Berapi 28 Februari 2024', 'WhatsApp_Image_2024-02-28_at_08_18_15_(2).jpeg', '<p class=\"docData;DOCY;v5;14902;\"><strong>Internalisasi Indikator Statistik</strong></p>', '2024-03-26 09:00:20', '199509142019032002', 'update', 0, NULL, NULL);
