(375, 'mQwJrC3Z4hT', 'f5eV5hdh7iI', '2024-03-27', 'Pengembangan Dashboard Kinerja', 'zoombupesta.jpg', '<p>Media Pertemuan: ZM</p>\r\n<p>Peserta: Fitral, Adrian, Reza Pulungan</p>\r\n<p>Dashboard Kinerja akan ditampilkan per Triwulanan</p>\r\n<p>Akan dibuat 2 Form Input per satker, yaitu form input Indikator Utama, dan form input Indikator Suplemen</p>', '2024-03-27 10:27:23', '198407082008011003', 'baru', 1, NULL, NULL),
(376, 'y6ACloPfe42', 'WD7TLRc7UKe', '2024-03-27', 'Berapi 27 Maret 2024', 'WhatsApp_Image_2024-03-27_at_8_57_40_AM.jpeg', '<p>Internalisasi Berakhlak <em><a href=\"https://drive.bps.go.id/apps/files/?dir=/%5B02.%20Share%20-%20BPS%20Provinsi%20Aceh%5D/08%20Tim%20Tranformasi%20dan%20Budaya%20Organisasi/Change%27s%20Team/BERAPI/27%20Maret%202024&amp;fileid=35374197\">Berapi 27 Maret</a></em></p>', '2024-03-27 11:15:21', '198507222011012015', 'baru', 1, NULL, NULL),
(377, '2wtNo1HaEoA', 'DE7uKkvCxpq', '2024-03-20', 'Undangan Pelatihan Petugas Survei  Perilaku Anti Korupsi (SPAK) 2024', 'image_2024-03-25_093328695.png', '<p>Surat dapat di akses melalui link : <a href=\"https://drive.google.com/drive/u/6/folders/1XRYeJ0pRssjq_7cpd1MjIoWWc7E-CJ2g\">https://drive.google.com/drive/u/6/folders/1XRYeJ0pRssjq_7cpd1MjIoWWc7E-CJ2g</a> &nbsp;</p>', '2024-03-27 11:26:26', '198109132006021001', 'update', 0, NULL, NULL),
(378, '0ZYRZbzkMzh', 'GwijEQUfrix', '2024-03-28', 'Penyampaian Hasil Pelatihan Instruktur Nasional (Innas)  Pendataan Potensi Desa (Podes) Tahun 2024', 'image_2024-04-01_090023120.png', '<p>Surat dapat diakses melalui link : <a href=\"https://drive.google.com/drive/u/6/folders/1hiN5fpJ_QU6M8iM3TOcoOMCKjWKw7b5d\">https://drive.google.com/drive/u/6/folders/1hiN5fpJ_QU6M8iM3TOcoOMCKjWKw7b5d</a>&nbsp;</p>', '2024-04-01 09:00:24', '198109132006021001', 'baru', 0, NULL, NULL),
(379, '07x8XQcQVBQ', 'lsGoCs9qdsQ', '2024-03-04', 'Pelatihan Innas Enumeration Area (EA)', 'Screenshot_2024-04-02_102545.png', '<p>Pelatihan Innas dilakukan pada tanggal:</p>\r\n<ol>\r\n<li>1 Maret 2024 (MOOC)</li>\r\n<li>4 Maret 2024 (Overviu kebijakan),&nbsp;</li>\r\n<li>5 Maret 2024 Pembelajaran jarak jauh</li>\r\n<li>6-8 Maret 2024 Pelatihan teknis</li>\r\n</ol>', '2024-04-02 10:29:53', '198906132012111001', 'baru', 1, NULL, NULL),
(380, 'YissINWRiQj', 'lsGoCs9qdsQ', '2024-03-19', 'Pemberitahuan rencana pelatihan dan permintaan nama Inda', 'Screenshot_2024-04-02_103317.png', '<p>Pelatihan akan dilaksanakan pada 22-26 April tahun 2024. Calon inda mengisi biodata pada tautan http://s.bps.go.id/Peserta_Pelatihan_Inda</p>', '2024-04-02 10:33:31', '198906132012111001', 'baru', 1, NULL, NULL),
(381, 'UoNCavAtKLB', 'SMgcAZid4Cv', '2024-03-26', 'Pemberitahuan kegiatan  Updating Direktori Usaha/Perusahaan Ekonomi Tahun 2024 dalam Rangka SE2026 ', 'Screenshot_2024-04-02_103832.png', '<ul>\r\n<li>pendataan lapangan kegiatan Updating Direktori Usaha/ Perusahaan Ekonomi Tahun 2024&nbsp;dalam rangka SE2026 akan dilaksanakan pada bulan <strong>Juli 2024</strong></li>\r\n<li>Pelatihan Inda akan&nbsp;diselenggarakan pada bulan <strong>Juni 2024 </strong>oleh BPS Provinsi melalui platform LMS Warkop</li>\r\n</ul>', '2024-04-02 10:38:50', '198906132012111001', 'baru', 1, NULL, NULL),
(382, '89YepR2HNux', 'YLiRbw4RNpg', '2024-02-13', 'Rekomendasi kegiatan Statistik P2K-APBA Biro Adpem Sekda Aceh dan profil Kependudukan SRKA Aceh', NULL, '<p>Integrasi kegiatan Rekomendasi dengan Pembinaan Statistik Sektoral</p>\r\n<ul>\r\n<li>Audiensi dengan <a href=\"https://webapps.bps.go.id/rujukan/pembinaan/public/dokumentasi/3387\" target=\"_blank\" rel=\"noopener\">Biro Administrasi Pembangunan Sekretariat Daerah Aceh Tanggal 23 januari 2024</a></li>\r\n<li>Audiensi dengan <a href=\"https://webapps.bps.go.id/rujukan/pembinaan/public/dokumentasi/3389\" target=\"_blank\" rel=\"noopener\">Dinas Registrasi dan Kependudukan Aceh Tanggal 25 januari 2024</a></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Surat Persetujuan permintaan Rekomendasi Kegiatan P2K-APBA Biro Administrasi Pembangunan dapat dilihat&nbsp;<a title=\"surat permintaan rekomendasi kegiatan P2K-APBA Biro Adpem Sekda Aceh\" href=\"https://romantik.web.bps.go.id/rekomendasi-terbit/K-24.1100.001\" target=\"_blank\" rel=\"noopener\">disini</a></p>\r\n<p>Surat Persetujuan permintaan Rekomendasi kegiatan Penyusunan profil Kependudukan Aceh Dinas Registrasi dan Kependudukan Aceh dapat dilihat <a title=\"surat permintaan rekomendasi kegiatan Profil kependudukan Aceh DRKA Aceh\" href=\"https://romantik.web.bps.go.id/rekomendasi-terbit/K-24.1100.002\" target=\"_blank\" rel=\"noopener\">disini</a></p>', '2024-04-02 10:49:10', '198512052008011002', 'baru', 1, NULL, NULL),
