(452, '2hMzZuIWDug', 'nqQ1MsfdBlM', '2024-06-11', 'Rapat Koordinasi Kegiatan Statistik Sosial', 'upload_file/image_timeline/Ub3TFuXup1CUczka44YSKBkX0irlfe5WsGhRKzcb.jpg', '<ul type=\"disc\">\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l5 level1 lfo1; tab-stops: list 36.0pt;\"><strong><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Beberapa Poin terkait Anomali data PODES 2024 :</span></strong></li>\r\n</ul>\r\n<ol start=\"1\" type=\"1\">\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l3 level1 lfo2; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Sesuai jadwal, BPS kabupaten/kota diharapkan segera melakukan approve data level PML, untuk selanjutnya dilakukan pemeriksaan oleh admin kabupaten/kota.</span></li>\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l3 level1 lfo2; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">BPS Kabupaten/kota diharapakan segera melakukan pemriksaan dan approve data oleh admin paling lambat tanggal 14 Juni 2024 .</span></li>\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l3 level1 lfo2; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Beberapa instrumen yang bisa digunakan untuk membantu pemeriksaan adalah menggunakan menu tabulasi data, kewajaran IKG/ID, dan anomali dari sqllab.</span></li>\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l3 level1 lfo2; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Rencananya pada jumat ini 14 Juni 2024, Pk. 07.30-selesai BPS Pusat akan mengadakan zoom meeting mengenai monitoring Podes 2024 sebagai tindak lanjut kegiatan sbelumnya akan dipimpin langsung oleh Bu Plt. Sehingga masing-masing bps kabupaten/kota diharapkan menyiapka bahan pendukung terhadap pertanyaan yang kemungkinan akan disampaikan oleh pimpinan mengenai dashboard.</span></li>\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l3 level1 lfo2; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Beberapa temuan dalam pemeriksaaan data podes diantaranya: penggunaan remark yang tidak sesuai sehingga menyebabkan rulval tidak jalan, pcl salah menempatkan isian, seperti ketiadaan infra namun jarak terdekat diisi di jumlah infra, namun pml kelewat periksa, serta adanya konsistensi antar isian tidak terjadi karena salah satu isian biasanya ada remark nya.</span></li>\r\n</ol>\r\n<ul type=\"disc\">\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l2 level1 lfo3; tab-stops: list 36.0pt;\"><strong><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Beberapa Poin terkait data kemiskinan :</span></strong></li>\r\n</ul>\r\n<ol start=\"1\" type=\"1\">\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l0 level1 lfo4; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">BPS Kabupaten/Kota diharapkan melengkapi data pendukung penghitungan kemiskinan paling lambat tanggal 14 Juni 2024. Kondisi tanggal 10 Juni 2024 terdapat delapan Kabupaten/kota lagi yang belum melengkapi data.</span></li>\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l0 level1 lfo4; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">BPS Kabupaten/kota telah melakukan review kota sister city terkait data inflasi sebagai salah satu penghitung garis kemiskinan.</span></li>\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l0 level1 lfo4; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">BPS Pusat akan melakukan percepatan penghitungan kemiskinan untuk angka kabupaten/kota.</span></li>\r\n</ol>\r\n<ul type=\"disc\">\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l4 level1 lfo5; tab-stops: list 36.0pt;\"><strong><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Evaluasi data Sakernas dan persiapan Pelaksanaan Sakernas Agustus 2024 :</span></strong></li>\r\n</ul>\r\n<ol start=\"1\" type=\"1\">\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l1 level1 lfo6; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Informasi yang dikumpulkan data sakernas.</span></li>\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l1 level1 lfo6; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Persiapan pelaksanaan sakernas agustus 2024 terkait Instruktur Daerah dan Petugas.</span></li>\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l1 level1 lfo6; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Pengisian Quality Gate.</span></li>\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l1 level1 lfo6; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Penyiapan Fenomena data sakernas.</span></li>\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l1 level1 lfo6; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Evaluasi data sementara hasil susenas agustus 2024 dari dashboard.</span></li>\r\n</ol>\r\n<ul type=\"disc\">\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l6 level1 lfo7; tab-stops: list 36.0pt;\"><strong><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Evaluasi data Susenas dan seruti serta&nbsp; persiapan Pelaksanaan Seruti dan Susenas September 2024:</span></strong></li>\r\n</ul>\r\n<ol start=\"1\" type=\"1\">\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l7 level1 lfo8; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Informasi yang dikumpulkan data susenas dan seruti.</span></li>\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l7 level1 lfo8; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Jumlah sampel susenas dan seruti.</span></li>\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l7 level1 lfo8; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Kuesioner yang digunakan susenas dan seruti.</span></li>\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l7 level1 lfo8; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Periode pengumpulan data susenas dan seruti.</span></li>\r\n<li class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-list: l7 level1 lfo8; tab-stops: list 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Level penyajian data susenas dan seruti.</span></li>\r\n</ol>', '2024-06-21 09:36:40', '198109132006021001', 'baru', 1, '2024-06-21 09:36:40', '2024-06-21 09:36:40'),
