(487, 'na5i3OIRGUq', 'qYYmHQtzpbw', '2024-07-10', 'NGOBRAS-Evaluasi Kualitas Data Seruti Triwulan II', 'upload_file/image_timeline/do12ornstAU1JJXoms7O9PLDERwItYQInRM2zL5J.jpg', '<p><span style=\"font-size: 12pt; font-family: \'andale mono\', monospace;\">Kegiatan ini dilaksanakan dalam rangka mengevaluasi anomali hasil pendataan lapangan &nbsp;Seruti Triwulan II di seluruh Kabupaten/Kota, beberapa point yang dibahas adalah terjadinya penurunan pada beberapa rincian diantaranya <span style=\"line-height: 107%;\">Makanan dan Minuman tidak beralkohol, Minuman beralkohol dan tembakau, Furnitur, Rekresi Keperluan Pesta dan Upacara atau kenduri, dan lain lain.</span></span></p>\r\n<p><span style=\"font-size: 12pt; font-family: \'andale mono\', monospace;\"><span style=\"line-height: 107%;\">Tindak lanjut dari kegiatan ini adalah, BPS Kako melalukan evaluasi kembali terhadap seluruh isian hasil pendataan lapangan.</span></span></p>', '2024-07-16 15:52:01', '198109132006021001', 'baru', 1, '2024-07-16 15:52:01', '2024-07-16 15:52:01'),
(488, 'A6Tm1QsdIun', 'or7gJNJZZV2', '2024-07-03', 'NGOBRAS-Rapat Evaluasi Kemiskinan Kabupaten/Kota 2024', 'upload_file/image_timeline/yZuuyILyETcseH3XGeUDWx6ycxAsn79DZfY2brH1.jpg', '<p>Kegiatan ini dihadiri oleh Kepala BPS Aceh, Kepala BPS Kako dan Seluruh Penanggung Jawab Statistik Sosial, kegiatan ini bertujuan untuk mengevaluasi kembali angka kemiskinan sementara kabupaten/kota, beberapa point yang disampaikan BPS kabupaten/kota pada pertemuan ini adalah :</p>\r\n<ul>\r\n<li>Melakukan evaluasi kembali terkait perubahan P0</li>\r\n<li>Melakukan evaluasi kembali Garis Kemiskinan</li>\r\n</ul>\r\n<p>Tindak lanjut dari kegiatan ini adalah, Tim Kemiskinan BPS Aceh akan mengkaji kembali angka kemiskinan sementara dan berkoordinasi dengan Tim Kemiskinan BPS Pusat sebelum angka difinalkan.</p>', '2024-07-16 15:58:08', '198109132006021001', 'baru', 1, '2024-07-16 15:58:08', '2024-07-16 15:58:08'),
(489, 'nFa6L9OcK61', 'or7gJNJZZV2', '2024-06-27', 'Rapat Pembahasan Angka Kemiskinan Kako Sementara 2024 di BPS Provinsi', 'upload_file/image_timeline/QrobPN1VCrqro5EeAYFO91IqcR5t0h38TK7m57Ko.jpg', '<p>Rapat ini dihadiri oleh Kepala BPS Aceh dan Tim Kemiskinan BPS Aceh, kegiatan ini bertujuan untuk membahas dan mengevaluasi Angka Kemiskinan Kako Sementara 2024.</p>', '2024-07-17 09:19:37', '198109132006021001', 'baru', 1, '2024-07-17 09:19:37', '2024-07-17 09:19:37'),
(490, 'jJLDq6eOv52', 'DGJgQuNK5hM', '2024-07-09', 'Pelatihan Inda Sakernas Agustus 2024', 'upload_file/image_timeline/J33PQKncaPycwB5db21MUIdtikepHUwbPJVRU1i3.jpg', '<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 115%; page-break-after: avoid; margin: 12.0pt -4.25pt .0001pt 0cm;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><span lang=\"SV\" style=\"line-height: 115%;\">pelatihan instruktur daerah </span><span style=\"line-height: 115%;\">Mengkobinasikan antara Pembelajaran Mandiri (<em>Massive Open Online Course </em>&ndash; MOOC) yang dilaksanakan <span>pada tanggal 5 dan 8 Juli 2024</span> dan dilanjutkan dengan Pembelajaran Jarak Jauh/PJJ (secara daring) <span>selama 4 hari, tanggal 9 s.d. 1 2 Juli 2024</span>.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 115%; page-break-after: avoid; margin: 12.0pt -4.25pt .0001pt 0cm;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><span lang=\"SV\" style=\"line-height: 115%;\">Adapun Peserta pelatihan ini diikuti sebanyak</span><span lang=\"SV\" style=\"line-height: 115%;\"> </span><span style=\"line-height: 115%;\">46 orang, seluruhnya berasal dari BPS Kabupaten/Kota dengan Instruktur Nasional sebanyak</span><span style=\"line-height: 115%;\"> <span><span lang=\"SV\">2 orang dari BPS Provinsi. Ibu Juliana dan Anandika</span></span></span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 115%; page-break-after: avoid; margin: 12.0pt -4.25pt .0001pt 0cm;\"><span lang=\"SV\" style=\"font-size: 12pt; line-height: 115%; font-family: arial, helvetica, sans-serif;\">Selama pembelajaran, akan dilakukan Evaluasi terhadap peserta yang meliputi beberapa point penilaian:</span></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: 115%; page-break-after: avoid; mso-list: l0 level1 lfo1; margin: 12.0pt -4.25pt .0001pt 36.0pt;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><!-- [if !supportLists]--><span lang=\"SV\" style=\"line-height: 115%;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font-style: normal; font-variant: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: normal; font-stretch: normal; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang=\"SV\" style=\"line-height: 115%;\">penilaian komponen substansi (teknis) </span></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: 115%; page-break-after: avoid; mso-list: l0 level1 lfo1; margin: 12.0pt -4.25pt .0001pt 36.0pt;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><!-- [if !supportLists]--><span lang=\"SV\" style=\"line-height: 115%;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font-style: normal; font-variant: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: normal; font-stretch: normal; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang=\"SV\" style=\"line-height: 115%;\">penilaian sikap perilaku. </span></span></p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: 115%; page-break-after: avoid; mso-list: l0 level1 lfo1; margin: 12.0pt -4.25pt .0001pt 36.0pt;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><!-- [if !supportLists]--><span lang=\"SV\" style=\"line-height: 115%;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font-style: normal; font-variant: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: normal; font-stretch: normal; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang=\"SV\" style=\"line-height: 115%;\">Penilaian komponen substansi (hardskill) diperoleh dari nilai Pretest, Kuis-kuis dan Posttest serta Evaluasi (awal dan akhir). </span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 115%; page-break-after: avoid; margin: 12.0pt -4.25pt .0001pt 0cm;\"><span lang=\"SV\" style=\"font-size: 12pt; line-height: 115%; font-family: arial, helvetica, sans-serif;\">Dari hasil rekapitukasi peserta pelatihan sebanyak : </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 115%; margin: 0cm -4.25pt 12.0pt 0cm;\"><span style=\"font-size: 12pt; line-height: 115%; background: yellow; font-family: arial, helvetica, sans-serif;\">PERNAH PELATIHAN : 72 % (sakernas februari 2024 atau sebelumnya)<span style=\"mso-spacerun: yes;\">&nbsp; </span><span style=\"mso-spacerun: yes;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>BELUM PERNAH PELATIHAN 28 %</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 115%; margin: 0cm -4.25pt 12.0pt 0cm;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><span style=\"line-height: 115%; background: yellow;\">LAKI-LAKI 52%<span style=\"mso-spacerun: yes;\">&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun: yes;\">&nbsp;</span>PEREMPUAN 48 %</span><span style=\"line-height: 115%;\"> </span></span></p>', '2024-07-17 09:23:32', '198109132006021001', 'baru', 1, '2024-07-17 09:23:32', '2024-07-17 09:23:32'),
